B.PF=new A.j(7,{id:1679073703185,question:"What is VPN? State advantages & disadvantages.",answer:"\nVPN (Virtual Private Network) : VPN or the **Virtual Private Network** is a private WAN\n(Wide Area Network) built on the internet. It allows the creation of a secured tunnel\n(protected network) between different networks using the internet (public network). By using the VPN, a client can connect to the organisation\u2019s network remotely.\n\nAdvantages of VPN :\n1. VPN is used to connect offices in different geographical locations remotely and is\ncheaper when compared to WAN connections.\n2. VPN is used for secure transactions and confidential data transfer between\nmultiple offices located in different geographical locations.\n3. VPN keeps an organisation\u2019s information secured against any potential threats or\nintrusions by using virtualization.\n4. VPN encrypts the internet traffic and disguises the online identity\n\nDisadvantages of VPN :\n1. Not designed for continuous use\n2. Complexity prevents scalability\n3. Lack of granular security\n4. Unpredictable performance\n5. Unreliable availability\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Ma=new A.j(7,{id:1679073566553,question:"What happens when you enter \u201cgoogle.com\u201d?",answer:"        \n1. Check the browser cache first if the content is fresh and present in the cache display the same.\n2. If not, the browser checks if the IP of the URL is present in the cache (browser and OS) if not then requests the OS to do a DNS lookup using UDP to get the corresponding IP address of the URL from the DNS server to establish a new TCP connection.\n3. A new TCP connection is set between the browser and the server using three-way handshaking.\n4. An HTTP request is sent to the server using the TCP connection.\n5. The web servers running on the Servers handle the incoming HTTP request and send the HTTP response.\n6. The browser processes the HTTP response sent by the server and may close the TCP connection or reuse the same for future requests.\n7. If the response data is cacheable then browsers cache the same.\nBrowser decodes the response and renders the content.\n\n> **Tip:** Popular question to ask for SDE role interviews\n\n\n    ",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.tx=new A.j(7,{id:1678598639704,question:"What is the difference between SQL and MySQL?",answer:"\n#### SQL\n- SQL is a standard language which stands for Structured Query Language based on the English language\n- SQL is the core of the relational database which is used for accessing and managing database\n\n\n#### MySQL\n- MySQL is a database management system.\n\n- MySQL is an RDMS (Relational Database Management System) such as SQL Server, Informix etc.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.tA=new A.j(7,{id:1678598764951,question:"What do you mean by DBMS? What are its different types?",answer:"\n**Database Management System (DBMS)** is a  software application that interacts with the user, applications, and the database itself to capture and analyze data. A database is a structured collection of data. \n\nA DBMS allows a user to interact with the database. The data stored in the database can be modified, retrieved and deleted and can be of any type like strings, numbers, images, etc.\n\nThere are two types of DBMS:\n\n1. **Relational Database Management System**: The data is stored in relations (tables). \nExample \u2013 MySQL.\n\n2. **Non-Relational Database Management System**: There is no concept of relations, tuples and attributes.  Example \u2013 MongoDB\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Yash Setu"},B.e,t.M)
B.tR=new A.j(7,{id:1678598946827,question:"What is RDBMS? How is it different from DBMS?",answer:"\nA relational database management system (RDBMS) is a set of applications and features that allow IT professionals and others to develop, edit, administer, and interact with relational databases. Most commercial relational database management systems use Structured Query Language (SQL) to access the database, which is stored in the form of tables.\nThe RDBMS is the most widely used database system in businesses all over the world. It offers a stable means of storing and retrieving massive amounts of data.\n\nDatabases, in general, hold collections of data that may be accessed and used in other applications. The development, administration, and use of database platforms are all supported by a database management system.\n\nA relational database management system (RDBMS) is a type of database management system (DBMS) that stores data in a row-based table structure that links related data components. An RDBMS contains functions that ensure the data\u2019s security, accuracy, integrity, and consistency. This is not the same as the file storage utilized by a database management system.\n\nThe following are some further distinctions between database management systems and relational database management systems:\n\n**The number of users who are permitted to utilise the system**\n\nA DBMS can only handle one user at a time, whereas an RDBMS can handle numerous users.\n\n\n**Hardware and software specifications**\n\nIn comparison to an RDBMS, a DBMS requires fewer software and hardware.\n\n\n**Amount of information**\n\nRDBMSes can handle any quantity of data, from tiny to enormous, whereas DBMSes are limited to small amounts.\n\n**The structure of the database**\n\nData is stored in a hierarchical format in a DBMS, whereas an RDBMS uses a table with headers that serve as column names and rows that hold the associated values.\n\n\n**Implementation of the ACID principle**\n\nThe atomicity, consistency, isolation, and durability (ACID) concept is not used by DBMSs for data storage. RDBMSes, on the other hand, use the ACID model to organize their data and assure consistency.\n\n\n**Databases that are distributed**\n\nA DBMS will not provide complete support for distributed databases, whereas an RDBMS will.\n\n**Programs that are managed**\n\n\nA DBMS focuses on keeping databases that are present within the computer network and system hard discs, whereas an RDBMS helps manage relationships between its incorporated tables of data.\n\n**Normalization of databases is supported**\n\nA RDBMS can be normalized , but a DBMS cannot be normalized.\n\n\n",category:"Graduate",topic:"SQL",level:1,uploader:"Yash Setu"},B.e,t.M)
B.tK=new A.j(7,{id:1678598973611,question:"What is a Self-Join?",answer:"\nA self-join is a type of join that can be used to connect two tables. As a result, it is a unary relationship. Each row of the table is attached to itself and all other rows of the same table in a self-join. As a result, a self-join is mostly used to combine and compare rows from the same database table.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.tD=new A.j(7,{id:1678599001133,question:"What is the SELECT statement?",answer:"\nA SELECT command gets zero or more rows from one or more database tables or views. The most frequent data manipulation language (DML) command is SELECT in most applications. SELECT queries define a result set, but not how to calculate it, because SQL is a declarative programming language.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.tJ=new A.j(7,{id:1678599066077,question:"What are some common clauses used with SELECT query in SQL?",answer:"\nThe following are some frequent SQL clauses used in conjunction with a SELECT query:\n\n**WHERE clause**: In SQL, the WHERE clause is used to filter records that are required depending on certain criteria.\n\n**ORDER BY clause**: The ORDER BY clause in SQL is used to sort data in ascending (ASC) or descending (DESC) order depending on specified field(s) (DESC).\n\n\n**GROUP BY clause**: GROUP BY clause in SQL is used to group entries with identical data and may be used with aggregation methods to obtain summarised database results.\n\n**HAVING clause** in SQL is used to filter records in combination with the GROUP BY clause. It is different from WHERE, since the WHERE clause cannot filter aggregated records.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.tw=new A.j(7,{id:1678599130896,question:"What are UNION, MINUS and INTERSECT commands?",answer:"\n- The **UNION** operator is used to combine the results of two tables while also removing duplicate entries.\n- The **MINUS** operator is used to return rows from the first query but not from the second query.\n- The **INTERSECT** operator is used to combine the results of both queries into a single row.\n\nBefore running either of the above SQL statements, certain requirements must be satisfied \u2013\nWithin the clause, each SELECT query must have the same amount of columns.\nThe data types in the columns must also be comparable.\nIn each SELECT statement, the columns must be in the same order.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.tX=new A.j(7,{id:1678599223698,question:"What is Cursor? How to use a Cursor?",answer:"\nAfter any variable declaration, DECLARE a cursor. A SELECT Statement must always be coupled with the cursor definition.\n\nTo start the result set, move the cursor over it. Before obtaining rows from the result set, the OPEN statement must be executed.\n\nTo retrieve and go to the next row in the result set, use the FETCH command.\n\nTo disable the cursor, use the CLOSE command.\n\nFinally, use the DEALLOCATE command to remove the cursor definition and free up the resources connected with it.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Od=new A.j(7,{id:1678599289255,question:"List the different types of relationships in SQL.",answer:"\nThere are different types of relations in the database:\n\n**One-to-One** \u2013 This is a connection between two tables in which each record in one table corresponds to the maximum of one record in the other.\n\n**One-to-Many** and **Many-to-One** \u2013 This is the most frequent connection, in which a record in one table is linked to several records in another.\n\n**Many-to-Many** \u2013 This is used when defining a relationship that requires several instances on each sides.\n\n**Self-Referencing Relationships** \u2013 When a table has to declare a connection with itself, this is the method to employ.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Op=new A.j(7,{id:1678599372420,question:"What are the differences between OLTP and OLAP?",answer:"\n- OLTP stands for **online transaction processing**, whereas OLAP stands for **online analytical processing**. \n- OLTP is an online database modification system, whereas OLAP is an online database query response system.\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Oi=new A.j(7,{id:1678599433679,question:"Explain character-manipulation functions? Explains its different types in SQL.",answer:"\nChange, extract, and edit the character string using character manipulation routines. The function will do its action on the input strings and return the result when one or more characters and words are supplied into it.\n\nThe character manipulation functions in SQL are as follows:\n\nA) **CONCAT** (joining two or more values): This function is used to join two or more values together. The second string is always appended to the end of the first string.\n\nB) **SUBSTR**: This function returns a segment of a string from a given start point to a given endpoint.\n\nC) **LENGTH**: This function returns the length of the string in numerical form, including blank spaces.\n\nD) **INSTR**: This function calculates the precise numeric location of a character or word in a string.\n\nE) **LPAD**: For right-justified values, it returns the padding of the left-side character value.\n\nF) **RPAD**: For a left-justified value, it returns the padding of the right-side character value.\n\nG) **TRIM**: This function removes all defined characters from the beginning, end, or both ends of a string. It also reduced the amount of wasted space.\n\nH) **REPLACE**: This function replaces all instances of a word or a section of a string (substring) with the other string value specified.\n",category:"Graduate",topic:"SQL",level:1,uploader:"Yash Setu"},B.e,t.M)
B.Mt=new A.j(7,{id:1678599748989,question:"What are joins in SQL?",answer:"A JOIN clause is used to combine rows from two or more tables, based on a related column between them. It is used to merge two tables or retrieve data from there. There are 4 types of joins, as you can refer to below:\n\n![enter image description here](https://i.postimg.cc/7h8KfTF5/Joins-SQL-interview-Questions-Edureka.png)\n\n- **Inner join**: Inner Join in SQL is the most common type of join. It is used to return all the rows from multiple tables where the join condition is satisfied. \n\n- **Left Join**:  Left Join in SQL is used to return all the rows from the left table but only the matching rows from the right table where the join condition is fulfilled.\n\n- **Right Join**: Right Join in SQL is used to return all the rows from the right table but only the matching rows from the left table where the join condition is fulfilled.\n\n- **Full Join**: Full join returns all the records when there is a match in any of the tables. Therefore, it returns all the rows from the left-hand side table and all the rows from the right-hand side table.\n\n\nSource: edureka.co",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.PZ=new A.j(7,{id:1678599795118,question:"What is a Primary key?",answer:"\n- A Primary key in SQL is a column (or collection of columns) or a set of columns that uniquely identifies each row in the table.\n- Uniquely identifies a single row in the table\nNull values not allowed\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Q3=new A.j(7,{id:1678599834215,question:"What are Constraints?",answer:"\nConstraints in SQL are used to specify the limit on the data type of the table. It can be specified while creating or altering the table statement. The sample of constraints are:\n\n- NOT NULL\n- CHECK\n- DEFAULT\n- UNIQUE\n- PRIMARY KEY\n- FOREIGN KEY\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.O3=new A.j(7,{id:1678599904851,question:"Explain different types of Normalization.",answer:"\nThere are many successive levels of normalization. These are called normal forms. Each consecutive normal form depends on the previous one.The first three normal forms are usually adequate.\n\nNormal Forms are used in database tables to remove or decrease duplication. The following are the many forms:\n\n**First Normal Form:**\nWhen every attribute in a relation is a single-valued attribute, it is said to be in first normal form. The first normal form is broken when a relation has a composite or multi-valued property.\n\n**Second Normal Form:**\nA relation is in second normal form if it meets the first normal form\u2019s requirements and does not contain any partial dependencies. In 2NF, a relation has no partial dependence, which means it has no non-prime attribute that is dependent on any suitable subset of any table candidate key. Often, the problem may be solved by setting a single column Primary Key.\n\n**Third Normal Form:**\nIf a relation meets the requirements for the second normal form and there is no transitive dependency, it is said to be in the third normal form.\n\n\n\n",category:"Graduate",topic:"SQL",level:1,uploader:"Yash Setu"},B.e,t.M)
B.NQ=new A.j(7,{id:1678599979690,question:"What is the ACID property in a database?",answer:"\nACID stands for Atomicity, Consistency, Isolation, Durability. It is used to ensure that the data transactions are processed reliably in a database system. \n\n- **Atomicity**: Atomicity refers to the transactions that are completely done or failed where transaction refers to a single logical operation of a data. It means if one part of any transaction fails, the entire transaction fails and the database state is left unchanged.\n- **Consistency**: Consistency ensures that the data must meet all the validation rules. In simple words,  you can say that your transaction never leaves the database without completing its state.\n- **Isolation**: The main goal of isolation is concurrency control.\n- **Durability**: Durability means that if a transaction has been committed, it will occur whatever may come in between such as power loss, crash or any sort of error.\n\n",category:"Graduate",topic:"SQL",level:0,uploader:"Yash Setu"},B.e,t.M)
B.ty=new A.j(7,{id:1678601996496,question:"What is a socket, kernel and monolithic kernel ? ",answer:"\n**Socket**:\nA socket is defined as an endpoint for communication, A pair of processes communicating over a network employ a pair of sockets ,one for each process. A socket is identified by an IP address concatenated with a port number.\nThe server waits for incoming client requests by listening to a specified port. Once a request is received, the server accepts a connection from the client socket to complete the connection.\n\n**Kernel:**\n\nKernel is the central core component of an operating system that manages operations of computer and hardware. Kernel Establishes communication between user level application and hardware. Manages memory and CPU time. Decides state of incoming processes. Controls Disk, Memory, Task Management\n\n**Monolithic Kernel** (provides good performance but lots of lines of code)\n\nIt is one of the types of kernel where all operating system services operate in kernel space. It has dependencies between system components. It has huge lines of code which is complex.\nExample : Unix, Linux, Open VMS, XTS-400 etc.\n\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tZ=new A.j(7,{id:1678602437073,question:"Difference between process and program and thread? Different types of process. ",answer:"\n**Process:**\nIt is an instance of an executing program. For example, we write our computer programs in a text file and when we execute this program, it becomes a process which performs all the tasks mentioned in the program.\n\n**Program:** It is a set of instructions to perform a certain task. Eg: chrome.exe, notepad.exe\n\n\n**Thread:**\nIt is a path of execution within a process. A thread is also known as a lightweight process. The idea is to achieve parallelism by dividing a process into multiple threads. For example,Word processor uses multiple threads: one thread to format the text, another thread to process inputs.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tY=new A.j(7,{id:1678602511495,question:"Define virtual memory, thrashing, threads.",answer:"\n**Virtual Memory:**\n\nA computer can address more memory than the amount physically installed on the system. This extra memory is actually called virtual memory and it is a section of a hard disk that\u2019s set up to emulate the computer\u2019s RAM.\nThe main visible advantage of this scheme is that programs can be larger than physical memory. Virtual memory serves two purposes. First, it allows us to extend the use of physical memory by using a disk. Second, it allows us to have memory protection, because each virtual address is translated to a physical address.\n\n**Thrashing:**\n\nThrashing is a condition or a situation when the system is spending a major portion of its time in servicing the page faults, but the actual processing done is very negligible. High degree of multiprogramming(if number of processes keeps on increasing in the memory), lack of frames (if a process is allocated too few frames, then there will be too many and too frequent page faults) causes Thrashing.\n\n**Threads:**\n\nA thread is a single sequential flow of execution of tasks of a process so it is also known as thread of execution or thread of control.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tI=new A.j(7,{id:1678603501776,question:"What is RAID ? Different types. ",answer:"\n- **RAID (Redundant Arrays of Independent Disks)** is a technique which makes use of a combination of multiple disks instead of using a single disk for increased performance, data redundancy or both.\n- Data redundancy, although taking up extra space, adds to disk reliability. \n- This means, in case of disk failure, if the same data is also backed up onto another disk, we can retrieve the data and go on with the operation.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.u1=new A.j(7,{id:1678603551842,question:"What is a deadlock? Different conditions to achieve a deadlock. ",answer:"\nA Deadlock is a situation where each of the computer processes waits for a resource which is being assigned to some other process. In this situation, none of the processes gets executed since the resource it needs is held by some other process which is also waiting for some other resource to be released.\n\nHow deadlock is achieved: Deadlock happens when Mutual exclusion, hold and wait, No preemption and circular wait occurs simultaneously.\n\nNecessary Conditions for deadlock:\n\n- Mutual Exclusion\n- Hold and Wait\n- No preemption\n- Circular Wait\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tP=new A.j(7,{id:1678603633623,question:"What is fragmentation? Types of fragmentation. ",answer:"\n**Fragmentation**:\n\n- An unwanted problem in the operating system in which the processes are loaded and unloaded from memory, and free memory space is fragmented. \n- Processes can\u2019t be assigned to memory blocks due to their small size, and the memory blocks stay unused.\n-  It is also necessary to understand that as programs are loaded and deleted from memory, they generate free space or a hole in the memory. \n- These small blocks cannot be allotted to new arriving processes, resulting in inefficient memory use.\n\n\nThe conditions of fragmentation depend on the memory allocation system. As the process is loaded and unloaded from memory, these areas are fragmented into small pieces of memory that cannot be allocated to incoming processes. It is called fragmentation.\n\nTypes of fragmentation:\n1. **Internal**\n2. **External**\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tO=new A.j(7,{id:1678603700064,question:"What is spooling? ",answer:"\n- SPOOL is an acronym for **simultaneous peripheral operations online**. \n- Spooling is a process in which data is temporarily held to be used and executed by a device, program, or system.\n- In spooling, there is no interaction between the I/O devices and the CPU. That means there is no need for the CPU to wait for the I/O operations to take place. Such operations take a long time to finish executing, so the CPU will not wait for them to finish.\n\n- The biggest example of Spooling is printing. The documents which are to be printed are stored in the SPOOL and then added to the queue for printing. During this time, many processes can perform their operations and use the CPU without waiting while the printer executes the printing process on the documents one-by-one.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tE=new A.j(7,{id:1678603780553,question:"What is Starving and Aging in OS?",answer:"\nStarving/Starvation(also called Lived lock): Starvation is the problem that occurs when low priority processes get jammed for an unspecified time as the high priority processes keep executing. So starvation happens if a method is indefinitely delayed.\n\nSolution to Starvation : Ageing is a technique of gradually increasing the priority of processes that wait in the system for a long time.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tN=new A.j(7,{id:1678603823441,question:"Why does trashing occur? ",answer:"\nHigh degree of multiprogramming(if number of processes keeps on increasing in the memory) , lack of frames(if a process is allocated too few frames, then there will be too many and too frequent page faults.) causes Thrashing.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tM=new A.j(7,{id:1678603885446,question:"What is paging and why do we need it? ",answer:"\n- Paging is a memory management scheme that eliminates the need for contiguous allocation of physical memory. This scheme permits the physical address space of a process to be non \u2013 contiguous.\n- Paging is used for faster access to data. When a program needs a page, it is available in the main memory(RAM) as the OS copies a certain number of pages from your storage device to main memory. \n- Paging allows the physical address space of a process to be noncontiguous.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tB=new A.j(7,{id:1678603951211,question:"Define Demand Paging, Segmentation.",answer:"\n**Demand paging** is a method of virtual memory management which is based on the principle that pages should only be brought into memory if the executing process demands them. This is often referred to as lazy evaluation as only those pages demanded by the process are swapped from secondary storage to main memory.\nSo demand paging works opposite to the principle of loading all pages immediately.\n\n**Segmentation** is a memory management technique in which the memory is divided into the variable size parts. Each part is known as a segment which can be allocated to a process.\n\nThe details about each segment are stored in a table called a segment table. Segment table is stored in one (or many) of the segments.\n\nSegment table contains mainly two information about segment:\n\nBase: It is the base address of the segment\nLimit: It is the length of the segment.\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tU=new A.j(7,{id:1678603991621,question:"What is Real Time Operating System, types of RTOS. ",answer:"\nA real-time operating system (RTOS) is a special-purpose operating system used in computers that has strict time constraints for any job to be performed and is intended to serve real time applications that possess data as it comes in , typically without buffer delays.\n\nTypes of RTOS:\n\n- Hard RTOS\n- Firm RTOS\n- Soft RTOS\n",category:"Graduate",topic:"Operating System",level:0,uploader:"Admin"},B.e,t.M)
B.tS=new A.j(7,{id:1678604222519,question:"Explain SRTF, LRTF, Priority ,Round Robin Scheduling.",answer:"#### SRTF Scheduling \nSRTF Scheduling is a preemptive version of SJF scheduling. In SRTF, the execution of the process can be stopped after a certain amount of time. At the arrival of every process, the short term scheduler schedules the process with the least remaining burst time among the list of available processes and the running process.\n\n#### LRTF Scheduling \nThis is a preemptive version of Longest Job First (LJF) scheduling algorithm. In this scheduling algorithm, we find the process with the maximum remaining time and then process it. We check for the maximum remaining time after some interval of time(say 1 unit each) to check if another process having more Burst Time arrived up to that time.\n\n\n#### Priority Scheduling \nPriority Scheduling is a method of scheduling processes that is based on priority. In this algorithm, the scheduler selects the tasks to work as per the priority.\n\nThe processes with higher priority should be carried out first, whereas jobs with equal priorities are carried out on a round-robin or FCFS basis. Priority depends upon memory requirements, time requirements, etc.\n\n#### Round Robin Scheduling \nIn Round-robin scheduling, each ready task runs turn by turn only in a cyclic queue for a limited time slice. This algorithm also offers starvation free execution of processes. Widely used preemptive scheduling method in traditional OS. All the jobs get a fair allocation of CPU. Cons include : Finding a correct time quantum is a quite difficult task in this system, Round-robin scheduling doesn\u2019t give special priority to more important tasks.\n\n\n\n",category:"Graduate",topic:"Operating System",level:1,uploader:"Admin"},B.e,t.M)
B.tG=new A.j(7,{id:1678708946894,question:"What is DBMS ? Explain advantages.",answer:"\n**Database Management System (DBMS)** is a software for storing and retrieving users\u2019 data while considering appropriate security measures. It consists of a group of programs which manipulate the database. The DBMS accepts the request for data from an application and instructs the operating system to provide the specific data. In large systems, a DBMS helps users and other third-party software to store and retrieve data.\n\nAdvantages:\n\n- Improved data sharing\n- Improved data security\n- Better data integration\n- Minimised data inconsistency\n- Improved data access\n- Improved decision making\n- Improved end-user productivity\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.u0=new A.j(7,{id:1678709055975,question:"What is RDBMS? Mention its properties",answer:"\nA Relational Database Management system (RDBMS) is a database management system that is based on the relational model. It has the following major components: Table, Record/Tuple/Row, Field, and Column/Attribute. Examples of the most popular RDBMS are MYSQL, Oracle, IBM DB2, and Microsoft SQL Server database.\n\nRelational databases have the following properties:\n\n- Values are atomic.\n- All of the values in a column have the same data type.\n- Each row is unique.\n- The sequence of columns is insignificant.\n- The sequence of rows is insignificant.\n- Each column has a unique name.\n- Integrity constraints maintain data consistency across multiple tables.\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.tL=new A.j(7,{id:1678709129205,question:"Name the types of database languages ",answer:"\n**Data Definition Language**: DDL stands for Data Definition Language. It is used to define database structure or pattern.\n\n**Data Manipulation Language**: DML stands for Data Manipulation Language. It is used for accessing and manipulating data in a database. It handles user requests.\n\n**Data Control Language**: DCL stands for Data Control Language. It is used to retrieve the stored or saved data.\n\n**Transaction Control Language**: TCL is used to run the changes made by the DML statement. TCL can be grouped into a logical transaction.\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.tQ=new A.j(7,{id:1678709190174,question:"What are ACID properties?",answer:"\nTo ensure the consistency of the database, certain properties are followed by all the\ntransactions occurring in the system.\nThese properties are called ACID Properties of a transaction.\n\n- **Atomicity**\n- **Consistency**\n- **Isolation**\n- **Durability**\n\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.tz=new A.j(7,{id:1678709231680,question:"Difference between vertical and horizontal scaling. ",answer:"\nScaling alters the size of a system. In the scaling process, we either compress or expand the system to meet the expected needs. The scaling operation can be achieved by adding resources to meet the smaller expectation in the current system, or by adding a new system in the existing one, or both.\n\nVertical scaling keeps your existing infrastructure but adds computing power. Your existing pool of code does not need to change \u2014 you simply need to run the same code on machines with better specs. By scaling up, you increase the capacity of a single machine and increase its throughput. Vertical scaling allows data to live on a single node, and scaling spreads the load through CPU and RAM resources for your machines.\n\nHorizontal scaling simply adds more instances of machines without first implementing improvements to existing specifications. By scaling out, you share the processing power and load balancing across multiple machines.\n\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.tT=new A.j(7,{id:1678709287787,question:"What is sharding?",answer:"- **Sharding** is a method of splitting and storing a single logical dataset in multiple databases. \n- By distributing the data among multiple machines, a cluster of database systems can store larger dataset and handle additional requests. \n- Sharding is necessary if a dataset is too large to be stored in a single database. Moreover, many sharding strategies allow additional machines to be added. \n- Sharding allows a database cluster to scale along with its data and traffic growth.\n\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.tV=new A.j(7,{id:1678709392561,question:"Explain KEYS in DBMS.",answer:"\nA key is a set of attributes that can identify each tuple uniquely in the given relation.\n\nTypes of Keys:\n\n- **Super Key** \u2013 A superkey is a set of attributes that can identify each tuple uniquely in the given relation. A super key may consist of any number of attributes.\n\n\n- **Candidate Key** \u2013 A set of minimal attribute(s) that can identify each tuple uniquely in the given relation is called a candidate key.\n\n- **Primary Key** \u2013 A primary key is a candidate key that the database designer selects while designing the database. Primary Keys are unique and NOT NULL.\n\n\n- **Alternate Key** \u2013 Candidate keys that are left unimplemented or unused after implementing the primary key are called alternate keys.\n\n- **Foreign Key** \u2013 An attribute \u2018X\u2019 is called as a foreign key to some other attribute \u2018Y\u2019 when its values are dependent on the values of attribute \u2018Y\u2019. The relation in which attribute \u2018Y\u2019 is present is called the referenced relation. The relation in which attribute \u2018X\u2019 is present is called the referencing relation.\n\n- **Composite Key** \u2013 A primary key composed of multiple attributes and not just a single attribute is called a composite key.\n\n- **Unique Key** \u2013 It is unique for all the records of the table. Once assigned, its value cannot be changed i.e. it is non-updatable. It may have a NULL value.\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.tH=new A.j(7,{id:1678709465877,question:"What are all types of relationship in DBMS?",answer:"\n- **Unary Relationship Set** \u2013 Unary relationship set is a relationship set where only one entity set participates in a relationship set.\n\n- **Binary Relationship Set** \u2013 Binary relationship set is a relationship set where two entity sets participate in a relationship set.\n\n- **Ternary Relationship Set** \u2013 Ternary relationship set is a relationship set where three entity sets participate in a relationship set.\n\n- **N-ary Relationship Set** \u2013 N-ary relationship set is a relationship set where \u2018n\u2019 entity sets participate in a relationship set.\n",category:"Graduate",topic:"DBMS",level:1,uploader:"Admin"},B.e,t.M)
B.tv=new A.j(7,{id:1678709572598,question:"What is DDL & DML?",answer:"\n- **DDL (Data Definition Language)**\n    \n  DDL stands for Data Definition Language. It is used to define database structure or pattern.\nIt is used to create schema, tables, indexes, constraints, etc. in the database.\nUsing the DDL statements, you can create the skeleton of the database.\nData definition language is used to store the information of metadata like the number of tables and schemas, their names, indexes, columns in each table, constraints, etc.\n\n- **DML (Data Manipulation Language)**\n   \n  DML stands for Data Manipulation Language. It is used for accessing and manipulating data in a database. It handles user requests.\n\n",category:"Graduate",topic:"DBMS",level:1,uploader:"Admin"},B.e,t.M)
B.tC=new A.j(7,{id:1678709631900,question:"What is normalization ? Types of normalization.",answer:"\n1. **Normalization** is the process of organizing data by disintegrating bigger table into smaller one\u2019s\nwith proper dependencies\n\n2. Redundant Data wastes a lot of disk space and creates maintenance problems (Update, Insert and Delete Anomaly). Hence the DB tables should be Normalized.\n\n3. The process of Normalization is achieved by following some rules which are defined as Normal Forms\n\n4. There are basically 3 types of Normal Form \u2013 1NF, 2NF, 3NF. Strictness increases as we go from 1NF to 3NF.\n\n5. Apart from the above mentioned Normal Form there exist one more Form called Boyce Codd Normal Form (BCNF) . This is an advanced version of 3NF and is even stricter than 3NF.\n",category:"Graduate",topic:"DBMS",level:1,uploader:"Admin"},B.e,t.M)
B.tW=new A.j(7,{id:1678709687230,question:"What is denormalization ? ",answer:"\n**Denormalization** is a database optimization technique in which we add redundant data to one or more tables. This can help us avoid costly joins in a relational database. Note that denormalization does not mean not doing normalisation. It is an optimization technique that is applied after doing normalisation.\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.u_=new A.j(7,{id:1678709762060,question:"What is E-R Model? ",answer:"\n- ER model stands for an Entity-Relationship model. It is a high-level data model. This model is used to define the data elements and relationship for a specified system.\n\n- It develops a conceptual design for the database. It also develops a very simple and easy to design view of data.\n\n- In ER modelling, the database structure is portrayed as a diagram called an entity-relationship diagram.\n",category:"Graduate",topic:"DBMS",level:0,uploader:"Admin"},B.e,t.M)
B.M8=new A.j(7,{id:1679034576543,question:"What is meant by network?",answer:"\n- A network is a set of devices that are connected with a physical media link. \n- In a network, two or more nodes are connected by a physical link or two or more networks are connected by one or more nodes. \n- A network is a collection of devices connected to each other to allow the sharing of data.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.MS=new A.j(7,{id:1679035175800,question:"What do you mean by network topology and its types?",answer:"\n- Network topology is the arrangement of nodes and links of a network.\n- Topologies are categorized as either physical network topology or logical network topology.\n- The topology of a network is key to determining its performance.\n- Network topology can be categorized into \u2013\n1. Bus Topology \n2. Ring Topology  \n3. Star Topology \n4. Mesh Topology \n5. Tree Topology\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Pd=new A.j(7,{id:1679035250749,question:"Define bandwidth, node and link? ",answer:"\n1. Bandwidth is the **data transfer capacity of a computer network in bits per second (Bps)**. The term may also be used colloquially to indicate a person\u2019s capacity for tasks or deep thoughts at a point in time.\n\n2. A network is a connection setup of two or more computers directly connected by some physical mediums like optical fibre or coaxial cable. This physical medium of connection is known as a link, and the computers that it is connected to are known as nodes\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Nl=new A.j(7,{id:1679035378528,question:"Explain TCP model.",answer:"\nIt is a compressed version of the OSI model with only 4 layers. It was developed by the US Department of Defence (DoD) in the 1860s. The name of this model is based on 2 standard protocols used i.e. TCP (Transmission Control Protocol) and IP (Internet Protocol).\n\n1. **Network Access/Link layer** : Decides which links such as serial lines or classic Ethernet must be used\nto meet the needs of the connectionless internet layer. Ex \u2013 Sonet, Ethernet\n2. **Internet** : The internet layer is the most important layer which holds the whole\narchitecture together. It delivers the IP packets where they are supposed to be\ndelivered. Ex \u2013 IP, ICMP.\n3. **Transport** : Its functionality is almost the same as the OSI transport layer. It\nenables peer entities on the network to carry on a conversation. Ex \u2013 TCP, UDP\n(User Datagram Protocol)\n4. **Application** : It contains all the higher-level protocols. Ex \u2013 HTTP, SMTP, RTP,\nDNS\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.MG=new A.j(7,{id:1679035425236,question:"Layers of OSI model. ",answer:"\nThere are majorly 2 main layers in the OSI model:\n\n- **Physical Layer**\n- **Data Link Layer**\n\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.N9=new A.j(7,{id:1679035537559,question:"Significance of Data Link Layer",answer:"\n\n- It is used for transferring the data from one node to another node.\n- It receives the data from the network layer and converts the data into data frames and then attaches the physical address to these frames which are sent to the physical layer.\n- It enables the error-free transfer of data from one node to another node.\n\nFunctions of Data-link layer:\n\n- Frame synchronisation:\nData-link layer converts the data into frames, and it ensures that the destination must recognize the starting and ending of each frame.\n- Flow control: Data-link layer controls the data flow within the network.\n- Error control: It detects and corrects the error occurred during the transmission from source to destination.\n- Addressing: Data-link layers attach the physical address with the data frames so that the individual machines can be easily identified.\n- Link management: Data-link layer manages the initiation, maintenance and termination of the link between the source and destination for the effective exchange of data.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Pt=new A.j(7,{id:1679072690449,question:"Define gateway, difference between gateway and router.",answer:"\n- A node that is connected to two or more networks is commonly known as a gateway. It is also known as a router. It is used to forward messages from one network to another. \n- Both the gateway and router regulate the traffic in the network. \n- Differences between gateway and router: A router sends the data between two similar networks while gateway sends the data between two dissimilar networks.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Ov=new A.j(7,{id:1679072743592,question:"What does ping command do? ",answer:"\nThe \u201c**ping**\u201d is a utility program that allows you to check the connectivity between the network devices. You can ping devices using its IP address or name.\n\n\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.MZ=new A.j(7,{id:1679072816192,question:"What is DNS, DNS forwarder, NIC? ",answer:"\n**DNS**:\n1. DNS is an acronym that stands for Domain Name System.DNS was introduced by Paul Mockapetris and Jon Postel in 1983.\n2. It is a naming system for all the resources over the internet which includes physical nodes and applications. It is used to locate resources easily over a network.\n3. DNS is an internet which maps the domain names to their associated IP addresses.\n4. Without DNS, users must know the IP address of the web page that you wanted to access.\n\n**DNS Forwarder** : \n1. A forwarder is used with a DNS server when it receives DNS queries that cannot be resolved quickly. \n2. So it forwards those requests to external DNS servers for resolution. A DNS server which is configured as a forwarder will behave differently than the DNS server which is not configured as a forwarder. \n3. NIC stands for Network Interface Card. It is a peripheral card attached to the PC to connect to a network. \n4. Every NIC has its own MAC address that identifies the PC on the network. It provides a wireless connection to a local area network. NICs were mainly used in desktop computers.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Ng=new A.j(7,{id:1679072866060,question:"What is MAC address? ",answer:"\nA media access control address (MAC address) is a unique identifier assigned to a network interface controller (NIC) for use as a network address in communications within a network segment.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.N3=new A.j(7,{id:1679072958001,question:"What is IP address, private IP address, public IP address, APIPA? ",answer:"\n**IP Address** \u2013 It is a unique address that identifies a device on the internet or a local network. IP stands for \u201cInternet Protocol,\u201d which is the set of rules governing the format of data sent via the internet or local network.\n\n**Private IP Address**\u2013 There are three ranges of IP addresses that have been reserved\nfor IP addresses. They are not valid for use on the internet. If you want to access the\ninternet on these private IPs, you must use a proxy server or NAT server.\n\n**Public IP Address** \u2013 A public IP address is an address taken by the Internet Service\nProvider which facilitates communication on the internet.\n\n**APIPA**- It stands for Automatic Private IP Addressing (APIPA). It is a feature or characteristic in operating systems (eg. Windows) which enables computers to self-configure an IP address and subnet mask automatically when their DHCP(Dynamic Host Configuration Protocol:A DHCP Server is a network server that automatically provides and assigns IP addresses, default gateways and other network parameters to client devices. It relies on the standard protocol known as Dynamic Host Configuration Protocol) server isn\u2019t reachable\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.QA=new A.j(7,{id:1679073044288,question:"What is subnet & Firewalls? ",answer:"\n**Subnet**\n\nA subnet is a network inside a network achieved by the process called subnetting which helps divide a network into subnets. It is used for getting a higher routing efficiency and enhances the security of the network. It reduces the time to extract the host address from the routing table.\n\n\n**Firewalls**\n\nThe firewall is a network security system that is used to monitor the incoming\nand outgoing traffic and blocks the same based on the firewall security policies. It acts as a wall between the internet (public network) and the networking devices (a private network). It is either a hardware device, software program, or a combination of both. It adds a layer of security to the network.",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.NT=new A.j(7,{id:1679073097158,question:"What are the type of delays?",answer:"\nThe delays, here, means the time for which the processing of a particular packet takes place.\n\nWe have the following types of delays in computer networks:\n\n- Transmission Delay\n- Propagation delay\n- Queueing delay\n- Processing delay\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.OA=new A.j(7,{id:1679073140275,question:"Explain 3 way handshaking.",answer:"\nThree-Way HandShake or a TCP 3-way handshake is a process which is used in a TCP/IP network to make a connection between the server and client. It is a three-step process that requires both the client and server to exchange synchronisation and acknowledgment packets before the real data communication process starts.\n\nThree-way handshake process is designed in such a way that both ends help you to initiate, negotiate, and separate TCP socket connections at the same time. It allows you to transfer multiple TCP socket connections in both directions at the same time.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Pa=new A.j(7,{id:1679073190472,question:"What is Server-side load balancer?",answer:"\nAll backend server instances are registered with a central load balancer. A client requests this load balancer which then routes the request to one of the server instances using various algorithms like round-robin. AWS ELB(Elastic Load Balancing) is a prime example of server-side load-balancing that registers multiple EC2 instances launched in its auto-scaling group and then routes the client requests to one of the EC2 instances.\n\nAdvantages of server-side load balancing:\n\n- Simple client configuration: only need to know the load-balancer address.\n- Clients can be untrusted: all traffic goes through the load-balancer where it can be looked at. Clients are not aware of the backend servers.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.N0=new A.j(7,{id:1679073243810,question:"Explain RSA Algorithm.",answer:"\nRSA algorithm is an asymmetric cryptography algorithm. Asymmetric actually means that it works on two different keys i.e. Public Key and Private Key. As the name describes, the Public Key is given to everyone and the Private key is kept private.\n\nAn example of asymmetric cryptography : A client (for example browser) sends its public key to the server and requests for some data. The server encrypts the data using the client\u2019s public key and sends the encrypted data. Client receives this data and decrypts it. Since this is asymmetric, nobody else except the browser can decrypt the data even if a third party has the public key of the browser.\n",category:"Graduate",topic:"Computer Network",level:1,uploader:"Admin"},B.e,t.M)
B.Of=new A.j(7,{id:1679073379022,question:"What is HTTP and HTTPS protocol? ",answer:"\n- **HTTP** is the **HyperText Transfer Protocol** which defines the set of rules and standards on how the information can be transmitted on the World Wide Web (WWW). \n- It helps the web browsers and web servers for communication. It is a \u2018stateless protocol\u2019 where each command is independent with respect to the previous command. HTTP is an application layer protocol built upon the TCP. \n- It uses port 80 by default. HTTPS is the HyperText Transfer Protocol Secure or Secure HTTP. \n- **HTTPS is an advanced and a secured version of HTTP**. \n- On top of HTTP, SSL/TLS protocol is used to provide security. It enables secure transactions by encrypting the communication and also helps identify network servers securely. It uses port 443 by default.\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.Oe=new A.j(7,{id:1679073614143,question:"Explain Hub vs Switch ",answer:"\n**Hub**: Hub is a networking device which is used to transmit the signal to each port\n(except one port) to respond from which the signal was received. Hub is operated on a Physical layer. In this packet filtering is not available. It is of two types: Active Hub, Passive Hub.\n\n**Switch**: Switch is a network device which is used to enable the connection\nestablishment and connection termination on the basis of need. Switch is operated on the Data link layer. In this packet filtering is available. It is a type of full duplex\ntransmission mode and it is also called an efficient bridge\n",category:"Graduate",topic:"Computer Network",level:0,uploader:"Admin"},B.e,t.M)
B.MM=new A.j(7,{id:1678542624496,question:"What are the four main features of OOPs?",answer:"\nThe OOP has the following four features:\n\n- Inheritance\n- Encapsulation\n- Polymorphism\n- Data Abstraction\n\n![enter image description here](https://i.postimg.cc/cCyPS4QZ/oops-interview-questions-q4.png)",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.QB=new A.j(7,{id:1678542845581,question:"What is Encapsulation?",answer:"\n- Encapsulation is also a part of the OOPs concept. \n- It refers to the bundling of data with the methods that operate on that data. \n- It also helps to restrict any direct access to some of an object\u2019s components.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Ok=new A.j(7,{id:1678542965600,question:"What is Abstraction?",answer:"\n- Abstraction is an OOPs concept to build the structure of real-world objects. \n- It \u201cshows\u201d only essential attributes and \u201chides\u201d unnecessary information from the outside. \n- The main focus of abstraction is to hide unnecessary details from the users. \n- It is one of the most important concepts of OOPs.\n\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.NC=new A.j(7,{id:1678543008902,question:"What is method overloading?",answer:"\n- There is a concept where two or more methods can have the same name. \n- But they should have different parameters, different numbers of parameters, different types, or both. \n- These methods are known as overloaded methods and this feature is called method overloading. \n\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Q4=new A.j(7,{id:1678543052828,question:"What is method overriding?",answer:"\n- Method overriding is a concept of object-oriented programming.\n\n- It is a language feature that allows a subclass or child class to provide a specific implementation of a method which is already provided by one of its superclasses or parent classes.\n\n\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.M3=new A.j(7,{id:1678543138852,question:"Types of Inheritance in OOPS",answer:"\nDifferent types of inheritances in OOps are as follows:\n\n- Single Inheritance\n- Multiple Inheritance\n- Multi-level Inheritance\n- Multi-path Inheritance\n- Hierarchical Inheritance\n- Hybrid Inheritance\n\n\n![enter image description here](https://i.postimg.cc/K8PPqcYB/image-53.png)",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Mv=new A.j(7,{id:1678543231149,question:"Is it possible to call the base class method without creating an instance?",answer:"\nYes, we can possibly call the base class method without creating an instance in the following 3 cases:\n\n1. If the method is static\n2. Calling the inherited method inside a derived class\n3. Calling the method using the base keyword from the sub-classes\n\nThe most popular case is that of the static methods.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.P1=new A.j(7,{id:1678543303256,question:"What are the limitations of OOPs?",answer:"\nFollowing are some of the common limitations of OOPs:\n\n1. Size exceeds that of other programs.\n2. It took a lot of work to make, and it runs more slowly than other programs.\n3. It is inappropriate for certain types of issues.\n4. It takes some getting used to.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.M4=new A.j(7,{id:1678543436340,question:"What are constructors? Types of constructor.",answer:"\nThe constructor has the same name as the class.\nA constructor is also a special kind of method. It is used to initialize objects of the class.\n\nTypes of constructors depend upon languages\n\n- Private Constructor\n- Default Constructor\n- Copy Constructor\n- Static Constructor\n- Parameterized Constructor\n\n![enter image description here](https://i.postimg.cc/RCP4twQn/Colorful-Process-Pie-Chart.png)\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.NF=new A.j(7,{id:1678545999177,question:"What are the access modifiers?",answer:"\n- Access modifiers or access specifiers are the keywords in object-oriented languages. \n- It helps to set the accessibility of **classes**, **methods**, and other members.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.PD=new A.j(7,{id:1678546131641,question:"What is inheritance?",answer:"\n- Whenever one class is derived from another, it is referred to as inheritance. \n- The child class will inherit all of the parent class\u2019s public and protected properties and methods. Apart from the attributes and methods inherited from the parent class, it can also have its own additional set of features. \n- The\u2019 extends\u2019 keyword is used to specify an inherited class.\n\n- If you derive a  class from another class that is known as inheritance. \n- The child class will inherit all the public and protected properties and methods from the parent class. \n- The child class can also have its own properties and methods. An inherited class is defined by using the extends keyword.\n\n\n![enter image description here](https://i.postimg.cc/4xfR85v5/table.png)",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.MU=new A.j(7,{id:1678546252481,question:"What is hybrid inheritance, hierarchical inheritance?",answer:"\n**Hybrid Inheritance**\n\nThe type of inheritance formed by the combination of different types of inheritances like single, multiple inheritances, etc. is classified as hybrid inheritance.\n\n**Hierarchical Inheritance**\n\nIn the case of a hierarchical inheritance, multiple subclasses inherit from a parent class. Hierarchical inheritance is a type of inheritance in which multiple classes are descended from a single parent or base class. For example, the fruit class can have \u2018apple\u2019, \u2019mango\u2019, \u2019banana\u2019, \u2018cherry\u2019 etc. as its subclasses.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.QG=new A.j(7,{id:1678546324667,question:"What are the limitations of inheritance?",answer:"\n- It Increases the execution time and effort. \n- It also requires jumping back and forth between different classes. \n- The parent class and the child class are always tightly coupled. \n- Afford modifications in the program would require changes for the parent and the child\u2019s class. \n- Inheritance requires careful implementation otherwise it would lead to incorrect results.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Oc=new A.j(7,{id:1678546537532,question:"What is a superclass & subclass?",answer:"\n**Superclass**\n\nA superclass is a class from which a subclass or child class is derived. Base class and parent class are other names for a superclass. For example, if Student is a class derived from the Person class, then the Person class will be referred to as the superclass.\n\nA superclass or base class is also a class that works as a parent to some other class/ classes.\n\nFor example, the Vehicle class is a superclass of class Bike.\n\n**Subclass**\n\nA class that derives from another class is referred to as a subclass. A subclass inherits the properties of its ancestors or parent classes. For example, the class Bike is a subclass or a derivative of the Vehicle class.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Q5=new A.j(7,{id:1678546751761,question:"What is Polymorphism? Explain Types.",answer:"\n**Polymorphism** is one of the most used and core concepts in OOP languages. It explains the concept of different classes can be used with the same interface. Each of these classes can have its own implementation of the interface. \n\nTypes:\n\n - **Static polymorphism**\n\n   In OOP, static polymorphism determines which method to call at compile time. For the same trigger with static polymorphism, the object might respond differently. Function, constructor and operator overloading are examples of static polymorphism.\n\n- **Dynamic polymorphism**\n\n   Dynamic polymorphism is a method or process that handles a call to an overridden method during runtime rather than at compile time. It is also referred to as dynamic method dispatch or runtime polymorphism. Using method overriding, we can create dynamic polymorphism. An example of runtime polymorphism: is method overriding.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Np=new A.j(7,{id:1678546893832,question:"Differentiate between overloading and overriding.",answer:"\nWhen two or more methods in the same class have the same name but different parameters, this is referred to as overloading. The technique of using the same method signature, i.e., name and parameters, in both the superclass and the child class is known as overriding.\n\n\n![enter image description here](https://i.postimg.cc/T3T1xnx7/table2.png)\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Pu=new A.j(7,{id:1678546957694,question:"What is encapsulation?",answer:"\nEncapsulation is used to wrap the data and the code which works in a single unit together. Example: Encapsulation allows data-hiding as the data specified in one class is hidden from other classes.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Ow=new A.j(7,{id:1678547014884,question:"What is data abstraction? How to achieve data abstraction?",answer:"\nData abstraction is one of the most important features of OOPs. It only allows important information to be displayed. It helps to hide the implementation details.\n\nFor example, while using a mobile, you know, how can you message or call someone but you don\u2019t know how it actually happens.\n\nThis is data abstraction as the implementation details are hidden from the user.\n\nData abstraction can be achieved using two ways:\n\n- Abstract class\n- Abstract method\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.NN=new A.j(7,{id:1678547170501,question:"What is Garbage Collection(GC)?",answer:"\n- Programming languages like C# and Java include garbage collection (GC) as a memory recovery mechanism. \n- A programming language that supports garbage collection (GC) contains one or more GC engines that automatically release memory space that has been reserved for things the application is no longer using.\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.ND=new A.j(7,{id:1678547610257,question:"What is a try/ catch finally  block?",answer:"\nThe terms \u201ctry\u201d and \u201ccatch\u201d describe how to handle exceptions brought on by coding or data mistakes while a program is running. The section of code where exceptions occur is called a try block. Exceptions from try blocks are caught and handled in a catch block.\n\nFinally designates the section of code that works with the try keyword. It specifies code that is always executed before the method is finished, immediately behind the try and any catch blocks. Regardless of whether an exception is thrown or caught, the finally block is always executed.\n\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Oq=new A.j(7,{id:1678547685731,question:"What is the difference between OOP and SOP?",answer:"\nThe key distinction between structured and object-oriented programming is that the former allows for the creation of programs using a collection of modules or functions, whilst the latter allows for the construction of programs using a collection of objects and their interactions.\n\nObject-oriented programming involves concepts of objects and classes. Everything is considered as an object which has specific properties and behaviours which are represented in a class. Object-oriented programming provides encapsulation and abstraction in the code. Ex: \u2013 Java Programming language.\n\nStructure-oriented programming involves the concepts of functions and structures. Everything is considered functionality and structures, represented using functions\u2014Ex: \u2013 C Programming language.\n\n\n",category:"Graduate",topic:"OOPs",level:0,uploader:"Yash Setu"},B.e,t.M)
B.Q_=new A.j(7,{id:1678547955431,question:"What is Coupling in OOP, and why is it helpful?",answer:"\nThe degree of dependency between the components is called coupling.\n\nTypes of Coupling\n\n**A. Tight Coupling** \u2013 If the dependency between components is high, these components are called tightly coupled.\n\nEx: \u2013\n\nBelow three Classes are highly dependent on each other hence they are tightly coupled.\n```\nclass P\n{\nstatic int a = Q.j;\n}\n \nclass Q\n{\nstatic int j = R.method();\n}\n \nclass R\n{\npublic static int method(){\nreturn 3;\n}\n```\n**B.  Loose Coupling** \u2013 If the dependency between components is low, it is called loose coupling. Loose coupling is preferred because of the following reasons:-\n\nIt increases the maintainability of code\nIt provides reusability of code\n",category:"Graduate",topic:"OOPs",level:1,uploader:"Yash Setu"},B.e,t.M)
B.PY=new A.j(7,{id:1678548051797,question:"What is Cohesion in OOP?",answer:"\n- The modules having well-defined and specific functionality are called cohesion.\n\n- It improves the maintainability and reusability of code.\n\n",category:"Graduate",topic:"OOPs",level:1,uploader:"Yash Setu"},B.e,t.M)
B.PG=new A.j(7,{id:1678548154209,question:"What are the types of variables in OOP?",answer:"\nVariables are basic units to store data in RAM for Java programs.\n\nVariables should be declared before using them in Java programming. Variable initialization can be static or dynamic. The syntax for variable declaration and static initialization is: \u2013\n\nTypes of variables\n\n- **Primitive Variables**: It is used to represent primitive values like int, float, etc.\n\n- **Reference Variables**: It is used to refer to objects in Java.\n- **Instance Variables**: Variables whose value varied from object to object are instance variables. For every object, a separate copy of the instance variable is created. Instance variables are declared within the Class and outside any method/block/constructor\n\n- **Static variables**: For static Variables, a single copy of the variable is created, and that copy is shared between every Class object. The static variable is created during class loading and destroyed at class unloading.\nStatic variables can be accessed directly from the static and instance area. We are not required to perform initialization explicitly for static variables, and JVM will provide default values.\n\n- **Local Variables**: Variables declared inside a method or block or constructor are local variables. Hence the scope of local variables is the same as the block\u2019s scope in which we declared that variable.\nJVM doesn\u2019t provide default values, and before using that variable, the initialization should be performed explicitly.\n",category:"Graduate",topic:"OOPs",level:1,uploader:"Yash Setu"},B.e,t.M)
B.Ot=new A.j(7,{id:1678548243045,question:"What is the output of the below code?",answer:"\n```\n\nclass Person\n{    \nprivate String show()\n{        \nreturn \u201cThis is a person\u201d;    \n}\n}\nclass Teacher extends Person\n{    \nprotected String show()\n{        \nreturn \u201cThis is a teacher\u201d;    \n}\n}\npublic class MathsTeacher extends Person\n{\n    @Override    public final String show()\n{        \nreturn \u201cThis is a Maths teacher\u201d;    \n}\npublic static void main(String[] name)\n{        \nfinal Person mt = new MathsTeacher();        \nSystem.out.print(mt.show());    \n}\n}\n```\nThe output will be: This is a Maths teacher\n",category:"Graduate",topic:"OOPs",level:1,uploader:"Yash Setu"},B.e,t.M)
