B.On=new A.j(7,{id:1675874105069,question:"Explain all components of a Hadoop application.",answer:"- **Hadoop Common**: It is a common set of utilities and libraries that are utilized by Hadoop.\n- **HDFS**: This Hadoop application relates to the file system in which the Hadoop data is stored. It is a distributed file system having high bandwidth.\n- **Hadoop MapReduce**: It is based according to the algorithm for the provision of large-scale data processing.\n- **Hadoop YARN**: It is used for resource management within the Hadoop cluster. It can also be used for task scheduling for users.\n\n![hadoop](https://i.postimg.cc/P5QS6xdw/Hadoonh-3-640x398.png)",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.NR=new A.j(7,{id:1675874226928,question:"Do you have any experience in building data systems using the Hadoop framework?",answer:"- If you have experience with Hadoop, state your answer with a detailed explanation of the work you did to focus on your skills and tool's expertise. You can explain all the essential features of Hadoop\n- . For example, you can tell them you utilized the Hadoop framework because of its scalability and ability to increase the data processing speed while preserving the quality.\n\nSome features of Hadoop include: \n\n- It is Java-Based. Hence, there may be no additional training required for team members. Also, it is easy to use. \n- As the data is stored within Hadoop, it is accessible in the case of hardware failure from other paths, which makes it the best choice for handling big data. \n- In Hadoop, data is stored in a cluster, making it independent of all the other operations.\n\n> **Tip**: In case you have no experience with this tool, learn the necessary information about the tool's properties and attributes.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.OB=new A.j(7,{id:1675874288433,question:"What is NameNode? What happens if NameNode crashes or comes to an end?\n",answer:"- It is the centre-piece or central node of the Hadoop Distributed File System(HDFS), and it does not store actual data. It stores metadata.\n-  For example, the data being stored in DataNodes on which rack and which DataNode the information is stored. \n- It tracks the different files present in clusters. Generally, there is one NameNode, so when it crashes, the system may not be available.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.Os=new A.j(7,{id:1675874759426,question:"Can you elaborate on Reducer in Hadoop MapReduce? Explain the core methods of Reducer?",answer:"**Reducer** is the second stage of data processing in the Hadoop Framework. The Reducer processes the data output of the mapper and produces a final output that is stored in HDFS. \n\nThe Reducer has 3 phases:\n\n- **Shuffle**: The output from the mappers is shuffled and acts as the input for Reducer.\n- **Sorting** is done simultaneously with shuffling, and the output from different mappers is sorted. \n\n- **Reduce**: in this step, Reduces aggregates the key-value pair and gives the required output, which is stored on HDFS and is not further sorted.\n\n\nThere are three core methods in Reducer:\n\n- **Setup** : it configures various parameters like input data size.\n- **Reduce** : It is the main operation of Reducer. In this method, a task is defined for the associated key.\n- **Cleanup**: This method cleans temporary files at the end of the task.\n",category:"Data Engineer",topic:"Hadoop",level:1,uploader:"Narayana Kailash"},B.e,t.M)
B.Nr=new A.j(7,{id:1675874843330,question:"How can you deploy a big data solution?",answer:"The steps involved are:\n\n- **Data Integration/Ingestion**: In this step, the extraction of data using data sources like RDBMS, Salesforce, SAP, MySQL is done.\n- **Data storage**: The extracted data would be stored in an HDFS or NoSQL database.\n- **Data processing**: the last step should be deploying the solution using processing frameworks like MapReduce, Pig, and Spark.\n",category:"Data Engineer",topic:"Big Data",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.QN=new A.j(7,{id:1675874929243,question:"What are the steps that occur when Block Scanner detects a corrupted data block?",answer:"Following are the steps that occur when Block Scanner find a corrupted data block:\n\n1) First of all, when Block Scanner find a corrupted data block, DataNode report to NameNode\n\n2) NameNode start the process of creating a new replica using a replica of the corrupted block.\n\n3) Replication count of the correct replicas tries to match with the replication factor. If the match found corrupted data block will not be deleted.",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.PL=new A.j(7,{id:1675874999944,question:"What are four V\u2019s of big data?",answer:"The four V\u2019s of big data are:\n\n- **Velocity**\n- **Variety**\n- **Volume**\n- **Veracity**",category:"Data Engineer",topic:"Big Data",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.NU=new A.j(7,{id:1675875084441,question:"Explain the use of Hive in Hadoop eco-system.",answer:"- Hive provides an interface to manage data stored in Hadoop eco-system. \n- Hive is used for mapping and working with HBase tables.\n-  Hive queries are converted into MapReduce jobs in order to hide the complexity associated with creating and running MapReduce jobs.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.PH=new A.j(7,{id:1675875125323,question:"Explain how .hiverc file in Hive is used.",answer:"- In Hive, .hiverc is the initialization file.\n- This file is initially loaded when we start Command Line Interface (CLI) for Hive. \n- We can set the initial values of parameters in .hiverc file.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.Mj=new A.j(7,{id:1675875222365,question:"What is COSHH?",answer:"**Classification and Optimization-based Scheduling for Heterogeneous Hadoop Systems**(COSHH), as the name implies, enables scheduling at both the cluster and application levels to have a direct positive impact on task completion time.\n\n",category:"Data Engineer",topic:"Hadoop",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.OD=new A.j(7,{id:1675875316968,question:"What are Skewed tables in Hive?",answer:"- Skewed tables are a type of table in which some values in a column appear more frequently than others.\n- The distribution is skewed as a result of this. \n- When a table is created in Hive with the SKEWED option, the skewed values are written to separate files, while the remaining data are written to another file.",category:"Data Engineer",topic:"Hive",level:0,uploader:"Mitul Aryan"},B.e,t.M)
B.Om=new A.j(7,{id:1677252383256,question:"What do you know about Big O notation?  ",answer:'        \n- Big-O notation also called as "asymptotic growth" notation is a relative representation of the complexity of an algorithm. \n- It shows how an algorithm scales based on input size. We use it to talk about how thing scale.\n - Big O complexity can be visualized with this graph-\n\n![BigO](https://i.postimg.cc/j5SGCg3Q/WcBRI.png)\n\n\n    ',category:"Machine Learning",topic:"Big-O notation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.O2=new A.j(7,{id:1677252474601,question:"Why there was a need to use Big O notation to compare algorithms?",answer:"        \n- The fact is it's difficult to determine the exact runtime of an algorithm. \n- It depends on the speed of the computer processor. So instead of talking about the runtime directly, we use Big O Notation to talk about how quickly the runtime grows depending on input size.\n\n- With Big O Notation, we use the size of the input, which we call n. So we can say things like the runtime grows \u201con the order of the size of the input\u201d (O(n)) or \u201con the order of the square of the size of the input\u201d (O(n2)).\n- Our algorithm may have steps that seem expensive when n is small but are eclipsed eventually by other steps as n gets larger. \n- For Big O Notation analysis, we care more about the stuff that grows fastest as the input grows, because everything else is quickly eclipsed as n gets very large.\n\n\n    ",category:"Machine Learning",topic:"Big-O notation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.N1=new A.j(7,{id:1677252804250,question:"Explain the difference between O(1) vs O(n) space complexities.",answer:"        \n- Let's consider a traversal algorithm for traversing a list.\n\n- O(1) denotes constant space use: the algorithm allocates the same number of pointers irrespective to the list size. \n- That will happen if we move (reuse) our pointer along the list.\nIn contrast, O(n) denotes linear space use: the algorithm space use grows together with respect to the input size n. \n- That will happen if let's say for some reason the algorithm needs to allocate 'N' pointers (or other variables) when traversing a list.\n\n    ",category:"Machine Learning",topic:"Big-O notation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Pc=new A.j(7,{id:1677252953594,question:"Why is text preprocessing done in NLP?",answer:"        \n- Text preprocessing is done to transform a text into a more digestible form so that the machine learning algorithms can perform better.\n- It is found that in tasks such as sentiment analysis, performing some preprocessing such as removing stop-words helps improve the accuracy of the machine learning model.\n\n- Some common text preprocessing done are:\n1. removing HTML tags\n2. removing stop-words\n3. removing numbers\n4. lower casing all letters\n5. Lemmatization\n\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.NL=new A.j(7,{id:1677253054658,question:"What is the difference between Lemmatisation and Stemming? ",answer:"        \nStemming just removes the last few characters of a word, often leading to incorrect meanings and spellings.\n\nConsider:\n\n```\neating -> eat, Caring -> Car.\n```\nLemmatization considers the context and converts the word to its meaningful base form, which is called Lemma.\n\nConsider:\n```\nStripes -> Strip (verb) -or- Stripe (noun), better -> good\n```\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.OM=new A.j(7,{id:1677253107882,question:"What is the use of PoS (Part of Speech) tagging?  ",answer:"        \n- PoS tagging is used to classify each word into its part of speech.\n- Parts of speech can be used to find grammatical, or lexical patterns without specifying the word used.\n- In English especially, the same word can be different parts of speech, so hence, PoS tagging can be helpful to differentiate between them.\n\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.MJ=new A.j(7,{id:1677253158327,question:"What are some of the advantages of using the Bag-of-Words to extract features?",answer:"        \n- It identifies the occurrence of words in a document. It identifies the vocabulary and the presence of known words. Hence, it is very simple and flexible.\n- It is intuitive that documents consisting of similar content will be similar in other ways such as meaning too. So, the BoW process will create a simple and quick group of features that can be used.\n- The BoW model can be made as simple, and as complicated as possible. The main difference is how the vocabulary of words is maintained, and how the different words are scored.\n\n\n    ",category:"Machine Learning",topic:"NLP",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.O6=new A.j(7,{id:1677253444921,question:"What is a One-Hot Vector? How can they be used in Natural Language Processing?  ",answer:'        \n- A one-hot is a group of bits which only has one high 1 bit and all other bits are low 0.\n- In Natural Language Processing, the one-hot vector can be used to represent a sentence in the form of a matrix of 1 x N size where N is the number of individual words in the corpus.\n- For example, the sentence "Peter picked a piece of pickled pepper" can be transformed into a matrix of 1 x 7 where each word is represented by the 7 columns. Hence the output of the sentence is: [0000001, 0000010, 0000100, 0001000, 0010000, 0100000, 1000000]\n- An understandable representation of a one-hot vector is shown by the diagram below:\n\n![enter image description here](https://miro.medium.com/max/1225/0*QMGjp-fPYpPaE3eK)\n\n\n    ',category:"Machine Learning",topic:"NLP",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.PS=new A.j(7,{id:1677253521018,question:"What are the different types of text Preprocessing?  ",answer:"        \nSteps of text preprocessing can be divided into 3 major types:\n\n- **Tokenization**: It is a process where a group of texts are divided into smaller pieces, or tokens. Paragraphs are tokenized into sentences, and sentences are tokenized into words.\n- **Normalization**: Database normalization is where the structure of the database is converted to a series of normal forms. What it achieves is the organization of the data to appear similar across all records and fields. Similarly, in the field of NLP, normalization can be the process of converting all the words to its lowercase. This makes all the sentences and tokens appear the same and does not complicate the machine learning algorithm.\n- **Noise Removal**: It is a process of cleaning up the text. Doing things such as removing characters which are not required, such as white spaces, numbers, special characters, etc.\n\n\n    ",category:"Machine Learning",topic:"NLP",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Ms=new A.j(7,{id:1677253694082,question:"How do you choose the optimal k in k-NN?",answer:"        \nThere is not a rule of thumb to choose a standard optimal k. This value depends and varies from dataset to dataset, but as a general rule, the main goal is to keep it:\n\n- small enough to exclude the samples of the other classes but\n- large enough to minimize any noise in the data.\n\nA way to looking for this optimal parameter, commonly called the Elbow method, consist in creating a for loop that trains various KNN models with different k values, keeping track of the error for each of these models, and use the model with the k value that achieves the best accuracy.\n\n![knn](https://i.postimg.cc/kD3gK6Hc/ct2ie.jpg)\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.OS=new A.j(7,{id:1677253857709,question:"What's the difference between k-Nearest Neighbors and Radius Nearest Neighbors?",answer:"        \n**KNN**\n- The k-neighbors classification is a very commonly used technique and is widely applied in various scenarios.\nKNN implements learning based on the k nearest neighbors of each query point, where k is a hyperparameter of an integer value.\n- The optimal choice of the value k is highly data-dependent: in general, a larger k suppresses the effects of noise but makes the classification boundaries less distinct.\n\n**RNN**\n- The r-neighbors classification is used in cases where the data is not uniformly sampled or is sparse.\n- RNN implements learning based on the number of neighbors within a fixed radius r of each training point, where r is a hyperparameter of the type float.\n- The optimal fixed radius r is chosen such that points in sparser neighborhoods use fewer nearest neighbors for the classification.\n\n\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Mo=new A.j(7,{id:1677254076369,question:"What is the main difference between k-Means and k-Nearest Neighbours?",answer:"        \n- **K-Means** is a clustering algorithm that tries to partition a set of points into k sets such that the points in each cluster tend to be near each other. It is unsupervised because the points have no external classification.\n\n![enter image description here](https://i.postimg.cc/RCfd5rRr/68747470733a2f2f7364732d706c6174666f726d2d707269766174652e73332d75732d656173742d322e616d617a6f6e6177.png)\n\n- **K-Nearest Neighbors** is a classification (or regression) algorithm that, in order to determine the classification of a point, combines the classification of the k nearest points. It is supervised because it is trying to classify a point based on the known classification of other points.\n\n![enter image description here](https://raw.githubusercontent.com/artifabrian/dynamic-knn-gpu/master/knn.png)\n\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.NI=new A.j(7,{id:1677254212378,question:"What is k-Nearest Neighbors algorithm?",answer:"        \n- **K-Nearest Neighbors** is a supervised machine learning algorithm that can be used to solve both classification and regression problems.\nIt assumes that similar things are closer to each other in certain feature spaces, in other words, similar things are in close proximity.\n\n![enter image description here](https://miro.medium.com/max/917/1*wW8O-0xVQUFhBGexx2B6hg.png)\n\n\n- The image above shows how similar points are closer to each other. KNN hinges on this assumption being true enough for the algorithm to be useful.\n- There are many different ways of calculating the distance between the points, however, the straight line distance (Euclidean distance) is a popular and familiar choice.\n\n    ",category:"Machine Learning",topic:"K-Nearest Neighbors",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.O9=new A.j(7,{id:1677331378952,question:"What is JVM ? Why is Java called the Platform Independent Programming Language?",answer:" \n- A Java virtual machine (JVM) is a process **virtual machine** that can execute Java **bytecode**. \n- Each Java source file is compiled\ninto a bytecode file, which is executed by the JVM. Java was designed to allow application programs to be built that could be\nrun on any platform, without having to be rewritten or recompiled by the programmer for each separate platform. \n- A Java virtual machine makes this possible, because it is aware of the specific instruction lengths and other particularities of the underlying\nhardware platform.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Q6=new A.j(7,{id:1677331470463,question:"What is the Difference between JDK and JRE ?",answer:" - The **Java Runtime Environment** (JRE) is basically the Java Virtual Machine (JVM) where your Java programs are being executed.\n- It also includes browser plugins for applet execution. \n- The **Java Development Kit** (JDK) is the full featured Software Development\nKit for Java, including the JRE, the compilers and tools (like _JavaDoc_, and _Java Debugger_), in order for a user to develop, compile\nand execute Java applications.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.PJ=new A.j(7,{id:1677331573726,question:"What does the \u201cstatic\u201d keyword mean ? Can you override private or static method in Java ?",answer:"- The **static** keyword denotes that a member variable or method can be accessed, without requiring an instantiation of the class to\nwhich it belongs.\n- A user cannot override static methods in Java, because method overriding is based upon dynamic binding at\nruntime and static methods are statically binded at compile time. \n- A static method is not associated with any instance of a class\nso the concept is not applicable.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mk=new A.j(7,{id:1677331630491,question:"Can you access non static variable in static context?",answer:"- A static variable in Java belongs to its class and its value remains the same for all its instances.\n- A static variable is initialized\nwhen the class is loaded by the JVM. If your code tries to access a non-static variable, without any instance, the compiler will\ncomplain, because those variables are not created yet and they are not associated with any instance.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MB=new A.j(7,{id:1677331727860,question:"What are the Data Types supported by Java ? What is Autoboxing and Unboxing?",answer:"The eight primitive data types supported by the Java programming language are:\n\n\u2022 byte\n\n\u2022 short\n\n\u2022 int\n\n\u2022 long\n\n\u2022 float\n\n\u2022 double\n\n\u2022 boolean\n\n\u2022 char\n\n **Autoboxing** is the automatic conversion made by the Java compiler between the primitive types and their corresponding object\nwrapper classes. For example, the compiler converts an int to an Integer, a double to a Double, and so on. If the conversion goes\nthe other way, this operation is called **Unboxing**.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MV=new A.j(7,{id:1677331796472,question:"What is Function Overriding and Overloading in Java?",answer:"- **Method overloading** in Java occurs when two or more methods in the same class have the exact same name, but different\nparameters. On the other hand, method overriding is defined as the case when a child class redefines the same method as a parent\nclass. \n- **Overridden methods** must have the same name, argument list, and return type. The overriding method may not limit the\naccess of the method it overrides.\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.O0=new A.j(7,{id:1677332462430,question:"What is a Constructor, Constructor Overloading in Java and Copy-Constructor?",answer:"        \n- A constructor gets invoked when a new object is created. Every class has a constructor. In case the programmer does not provide\na constructor for a class, the Java compiler (Javac) creates a default constructor for that class. \n- The constructor overloading is\nsimilar to method overloading in Java. Different constructors can be created for a single class. \n- Each constructor must have its\nown unique parameter list. Finally, Java does support copy constructors like C++, but the difference lies in the fact that Java\ndoesn\u2019t create a default copy constructor if you don\u2019t write your own.\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OZ=new A.j(7,{id:1677332577527,question:"Does Java support multiple inheritance?",answer:"\n- No, Java does not support multiple inheritance.\n- Each class is able to extend only on one class, but is able to implement more than\none interfaces.\n\n\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MY=new A.j(7,{id:1677332677692,question:"What is the difference between an Interface and an Abstract class?",answer:"        \nJava provides and supports the creation both of **abstract classes** and **interfaces**. Both implementations share some common\ncharacteristics, but they differ in the following features:\n\n\u2022 All methods in an interface are implicitly abstract. On the other hand, an abstract class may contain both abstract and nonabstract methods.\n\n\u2022 A class may implement a number of Interfaces, but can extend only one abstract class.\n\n\u2022 In order for a class to implement an interface, it must implement all its declared methods. However, a class may not implement\nall declared methods of an abstract class. Though, in this case, the sub-class must also be declared as abstract.\n\n\u2022 Abstract classes can implement interfaces without even providing the implementation of interface methods.\n\n\u2022 Variables declared in a Java interface is by default final. An abstract class may contain non-final variables.\n\n\u2022 Members of a Java interface are public by default. A member of an abstract class can either be private, protected or public.\n\n\u2022 An interface is absolutely abstract and cannot be instantiated. An abstract class also cannot be instantiated, but can be invoked\nif it contains a main method.\n    ",category:"Java",topic:"General",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.P3=new A.j(7,{id:1677332799006,question:"What is the difference between processes and threads?",answer:"- A process is an execution of a program, while a Thread is a single execution sequence within a process. \n- A process can contain multiple threads.\n- A Thread is sometimes called a lightweight process.\n\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.PQ=new A.j(7,{id:1677333836498,question:"Explain different ways of creating a thread. Which one would you prefer and why?",answer:"There are three ways that can be used in order for a Thread to be created:\n\n\u2022 A class may extend the Thread class.\n\n\u2022 A class may implement the Runnable interface.\n\n\u2022 An application can use the Executor framework, in order to create a thread pool.\n\nThe **Runnable** interface is preferred, as it does not require an object to inherit the Thread class. In case your application design\nrequires multiple in\n\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nn=new A.j(7,{id:1677334188616,question:" Explain the available thread states in a high-level.",answer:"        \nDuring its execution, a thread can reside in one of the following states:\n\n\u2022 **Runnable**: A thread becomes ready to run, but does not necessarily start running immediately.\n\n\u2022 **Running**: The processor is actively executing the thread code.\n\n\u2022 **Waiting**: A thread is in a blocked state waiting for some external processing to finish.\n\n\u2022 **Sleeping**: The thread is forced to sleep.\n\n\u2022 **Blocked on I/O**: Waiting for an I/O operation to complete.\n\n\u2022 **Blocked on Synchronization**: Waiting to acquire a lock.\n\n\u2022 **Dead**: The thread has finished its execution.\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Qu=new A.j(7,{id:1677334504810,question:"What is the difference between a synchronized method and a synchronized block?",answer:"- In Java programming, each object has a lock. A thread can acquire the lock for an object by using the synchronized keyword.\n- The synchronized keyword can be applied in a method level (coarse grained lock) or block level of code (fine grained lock).\n\n\n    ",category:"Java",topic:"Threads",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OR=new A.j(7,{id:1677334708349,question:"What are the basic interfaces of Java Collections Framework?",answer:"\n**Java Collections Framework** provides a well designed set of interfaces and classes that support operations on a collections of\nobjects. \n\nThe most basic interfaces that reside in the Java Collections Framework are:\n\n\u2022 **Collection**: which represents a group of objects known as its elements.\n\n\u2022 **Set**: which is a collection that cannot contain duplicate elements.\n\n\u2022 **List**: which is an ordered collection and can contain duplicate elements.\n\n\u2022 **Map**: which is an object that maps keys to values and cannot contain duplicate keys\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Ml=new A.j(7,{id:1677334939822,question:"Why Collection doesn\u2019t extend Cloneable and Serializable interfaces?",answer:"- The Collection interface specifies groups of objects known as elements. \n- Each concrete implementation of a Collection can choose\nits own way of how to maintain and order its elements. \n- Some collections allow duplicate keys, while some other collections don\u2019t.\nThe semantics and the implications of either cloning or serialization come into play when dealing with actual implementations.\n- Thus, the concrete implementations of collections should decide how they can be cloned or serialized.\n    ",category:"Java",topic:"Collections",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Oy=new A.j(7,{id:1677335270583,question:"What differences exist between Iterator and ListIterator?",answer:"The differences of these elements are listed below:\n\n\u2022 An Iterator can be used to traverse the Set and List collections, while the ListIterator can be used to iterate only over Lists.\n\n\u2022 The Iterator can traverse a collection only in forward direction, while the ListIterator can traverse a List in both directions.\n\n\u2022 The ListIterator implements the Iterator interface and contains extra functionality, such as adding an element, replacing an\nelement, getting the index position for previous and next elements, etc.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OW=new A.j(7,{id:1677335435778,question:"How HashMap works in Java?",answer:" - A HashMap in Java stores key-value pairs. \n- The HashMap requires a hash function and uses hashCode and equals methods,\nin order to put and retrieve elements to and from the collection respectively. \n- When the put method is invoked, the HashMap\ncalculates the hash value of the key and stores the pair in the appropriate index inside the collection. \n- If the key exists, its value\nis updated with the new value. \n- Some important characteristics of a HashMap are its capacity, its load factor and the thresholdresizing.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nx=new A.j(7,{id:1677335518321,question:"What is the importance of hashCode() and equals() methods?",answer:"- In Java, a **HashMap** uses the hashCode and equals methods to determine the index of the key-value pair and to detect duplicates.\n- More specifically, the hashCode method is used in order to determine where the specified key will be stored. \n- Since different keys\nmay produce the same hash value, the equals method is used, in order to determine whether the specified key actually exists in\nthe collection or not. \n- Therefore, the implementation of both methods is crucial to the accuracy and efficiency of the HashMap.\n\n\n    ",category:"Java",topic:"Collections",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nu=new A.j(7,{id:1677335638325,question:"What differences exist between HashMap and Hashtable?",answer:" Both the HashMap and Hashtable classes implement the Map interface and thus, have very similar characteristics. However, they\ndiffer in the following features:\n\n\u2022 A HashMap allows the existence of null keys and values, while a Hashtable doesn\u2019t allow neither null keys, nor null values.\n\n\u2022 A Hashtable is synchronized, while a HashMap is not. Thus, HashMap is preferred in single-threaded environments, while a\nHashtable is suitable for multi-threaded environments.\n\n\u2022 A HashMap provides its set of keys and a Java application can iterate over them. Thus, a HashMap is fail-fast. On the other\nhand, a Hashtable provides an Enumeration of its keys.\n\n\u2022 The Hashtable class is considered to be a legacy class\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OU=new A.j(7,{id:1677335716741,question:"What is difference between Array and ArrayList ? When will you use Array over ArrayList?",answer:"The Array and ArrayList classes differ on the following features:\n\n\u2022 Arrays can contain primitive or objects, while an ArrayList can contain only objects.\n\n\u2022 Arrays have fixed size, while an ArrayList is dynamic.\n\n\u2022 An ArrayList provides more methods and features, such as addAll, removeAll, iterator, etc.\n\n\u2022 For a list of primitive data types, the collections use autoboxing to reduce the coding effort. However, this approach makes\nthem slower when working on fixed size primitive data types.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mh=new A.j(7,{id:1677335813905,question:"What is difference between ArrayList and LinkedList?",answer:"Both the **ArrayList** and **LinkedList** classes implement the List interface, but they differ on the following features:\n\n\u2022 An ArrayList is an index based data structure backed by an Array. It provides random access to its elements with a performance\nequal to O(1). On the other hand, a LinkedList stores its data as list of elements and every element is linked to its previous and\nnext element. In this case, the search operation for an element has execution time equal to O(n).\n\n\u2022 The Insertion, addition and removal operations of an element are faster in a LinkedList compared to an ArrayList, because\nthere is no need of resizing an array or updating the index when an element is added in some arbitrary position inside the\ncollection.\n\n\u2022 A LinkedList consumes more memory than an ArrayList, because every node in a LinkedList stores two references, one for its\nprevious element and one for its next element\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Pz=new A.j(7,{id:1677335904121,question:"What do you know about the big-O notation and can you give some examples with respect to different data structures ?",answer:"- The **Big-O notation** simply describes how well an algorithm scales or performs in the worst case scenario as the number of elements in a data structure increases. \n- The Big-O notation can also be used to describe other behavior such as memory consumption.\n- Since the collection classes are actually data structures, we usually use the Big-O notation to chose the best implementation to\nuse, based on time, memory and performance. \n- Big-O notation can give a good indication about performance for large amounts\nof data.\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MC=new A.j(7,{id:1677336011303,question:"What is the tradeoff between using an unordered array versus an ordered array?",answer:"- The major advantage of an ordered array is that the search times have time complexity of O(log n), compared to that of an\nunordered array, which is O (n). \n- The disadvantage of an ordered array is that the insertion operation has a time complexity of\nO(n), because the elements with higher values must be moved to make room for the new element. \n- Instead, the insertion operation for an unordered array takes constant time of O(1).\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Pn=new A.j(7,{id:1677336086785,question:"What is the difference between HashSet and TreeSet?",answer:"- The HashSet is Implemented using a hash table and thus, its elements are not ordered. \n- The add, remove, and contains methods of\na HashSet have constant time complexity O(1). \n- On the other hand, a TreeSet is implemented using a tree structure. \n- The elements\nin a TreeSet are sorted, and thus, the add, remove, and contains methods have time complexity of O(logn).\n\n\n    ",category:"Java",topic:"Collections",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Na=new A.j(7,{id:1677343275162,question:"What is the purpose of garbage collection in Java, and when is it used?",answer:"The purpose of garbage collection is to **identify** and **discard** those objects that are no longer needed by the application, in order\nfor the resources to be reclaimed and reused.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MR=new A.j(7,{id:1677343331892,question:"What does System.gc() and Runtime.gc() methods do?",answer:"- These methods can be used as a hint to the JVM, in order to start a garbage collection. \n\n- However, this it is up to the Java Virtual\nMachine (JVM) to start the garbage collection immediately or later in time.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mw=new A.j(7,{id:1677343401257,question:"What is structure of Java Heap ? What is Perm Gen space in Heap?",answer:"- The JVM has a heap that is the runtime data area from which memory for all class instances and arrays is allocated. \n- It is created\nat the JVM start-up. Heap memory for objects is reclaimed by an automatic memory management system which is known as a\ngarbage collector. \n- Heap memory consists of live and dead objects. Live objects are accessible by the application and will not\nbe a subject of garbage collection. \n- Dead objects are those which will never be accessible by the application, but have not been\ncollected by the garbage collector yet.\n- Such objects occupy the heap memory space until they are eventually collected by the\ngarbage collector.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.O1=new A.j(7,{id:1677343456764,question:"What is the difference between Serial and Throughput Garbage collector?",answer:"- The throughput garbage collector uses a parallel version of the young generation collector and is meant to be used with applications that have medium to large data sets.\n-  On the other hand, the serial collector is usually adequate for most small applications\n(those requiring heaps of up to approximately 100MB on modern processors)\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Qd=new A.j(7,{id:1677343492582,question:"When does an Object becomes eligible for Garbage collection in Java?",answer:"A Java object is subject to garbage collection when it becomes unreachable to the program in which it is currently used.",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OH=new A.j(7,{id:1677343542969,question:"Does Garbage collection occur in permanent generation space in JVM ?",answer:"- Garbage Collection does occur in PermGen space and if PermGen space is full or cross a threshold, it can trigger a full garbage\ncollection.\n-  If you look carefully at the output of the garbage collector, you will find that PermGen space is also garbage collected.\n- This is the reason why correct sizing of PermGen space is important to avoid frequent full garbage collections. Also check our\narticle Java 8: PermGen to Metaspace.\n\n\n    ",category:"Java",topic:"Garbage Collectors",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.N5=new A.j(7,{id:1677343691326,question:"What are the two types of Exceptions in Java ? Which are the differences between them?",answer:"        \n- Java has two types of exceptions: checked exceptions and unchecked exceptions. \n- Unchecked exceptions do not need to be\ndeclared in a method or a constructor\u2019s throws clause, if they can be thrown by the execution of the method or the constructor,\nand propagate outside the method or constructor boundary. \n- On the other hand, checked exceptions must be declared in a method\nor a constructor\u2019s throws clause. See here for tips on Java exception handling\n\n    ",category:"Java",topic:"Exception Handling",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Pg=new A.j(7,{id:1677343760644,question:"What is the difference between Exception and Error in Java?",answer:"        \n- **Exception** and **Error** classes are both subclasses of the Throwable class. \n- The Exception class is used for exceptional conditions\nthat a user\u2019s program should catch.\n- The Error class defines exceptions that are not excepted to be caught by the user program.\n\n    ",category:"Java",topic:"Exception Handling",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.M5=new A.j(7,{id:1677343811781,question:"What is the difference between throw and throws?",answer:"        \n- The throw keyword is used to explicitly raise a exception within the program.\n-  On the contrary, the throws clause is used to\nindicate those exceptions that are not handled by a method. \n- Each method must explicitly specify which exceptions does not\nhandle, so the callers of that method can guard against possible exceptions. \n- Finally, multiple exceptions are separated by a\ncomma.\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.ON=new A.j(7,{id:1677343954432,question:"What is the importance of finally block in exception handling?",answer:"        \n- A finally block will always be executed, whether or not an exception is actually thrown. \n- Even in the case where the catch\nstatement is missing and an exception is thrown, the finally block will still be executed. \n- Last thing to mention is that the finally\nblock is used to release resources like I/O buffers, database connections, etc.\n\n    ",category:"Java",topic:"Garbage Collectors",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Qp=new A.j(7,{id:1677344024413,question:"What is an Applet in Java?",answer:"        \n- A Java applet is program that can be included in a HTML page and be executed in a java enabled client browser.\n- Applets are used\nfor creating dynamic and interactive web applications.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.PI=new A.j(7,{id:1677344073991,question:" Explain the life cycle of an Applet.",answer:"        \nAn applet may undergo the following states:\n\n\u2022 **Init**: An applet is initialized each time is loaded.\n\n\u2022 **Start**: Begin the execution of an applet.\n\n\u2022 **Stop**: Stop the execution of an applet.\n\n\u2022 **Destroy**: Perform a final cleanup, before unloading the applet.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Ql=new A.j(7,{id:1677344150415,question:"What are the restrictions imposed on Java applets?",answer:"        \nMostly due to security reasons, the following restrictions are imposed on Java applets:\n\n- An applet cannot load libraries or define native methods.\n\n- An applet cannot ordinarily read or write files on the execution host.\n\n- An applet cannot read certain system properties.\n\n- An applet cannot make network connections except to the host that it came from.\n\n- An applet cannot start any program on the host that\u2019s executing it.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Ny=new A.j(7,{id:1677344211390,question:"What is the difference between applets loaded over the internet and applets loaded via the file system?",answer:"        \n- Regarding the case where an applet is loaded over the internet, the applet is loaded by the applet classloader and is subject to the\nrestrictions enforced by the applet security manager. \n- Regarding the case where an applet is loaded from the client\u2019s local disk,\nthe applet is loaded by the file system loader. \n- Applets loaded via the file system are allowed to read files, write files and to load\nlibraries on the client. \n- Also, applets loaded via the file system are allowed to execute processes and finally, applets loaded via the file system are not passed through the byte code verifier.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.NE=new A.j(7,{id:1677344293106,question:"What is the applet class loader, and what does it provide?",answer:"        \n- When an applet is loaded over the internet, the applet is loaded by the applet classloader. \n- The class loader enforces the Java name\nspace hierarchy. \n- Also, the class loader guarantees that a unique namespace exists for classes that come from the local file system,\nand that a unique namespace exists for each network source. \n- When a browser loads an applet over the net, that applet\u2019s classes\nare placed in a private namespace associated with the applet\u2019s origin. \n- Then, those classes loaded by the class loader are passed\nthrough the verifier.The verifier checks that the class file conforms to the Java language specification. \n- Among other things, the\nverifier ensures that there are no stack overflows or underflows and that the parameters to all bytecode instructions are correct.\n\n    ",category:"Java",topic:"Applets",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Q0=new A.j(7,{id:1677344350319,question:"What is the applet security manager, and what does it provide?",answer:"        \n- The applet security manager is a mechanism to impose restrictions on Java applets. \n- A browser may only have one security\nmanager. \n- The security manager is established at startup, and it cannot thereafter be replaced, overloaded, overridden, or extended.\n\n    ",category:"Java",topic:"Applets",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Nz=new A.j(7,{id:1677344426771,question:"What is the difference between a Choice and a List?",answer:"        \n- A Choice is displayed in a compact form that must be pulled down, in order for a user to be able to see the list of all available\nchoices. \n- Only one item may be selected from a Choice. \n- A List may be displayed in such a way that several List items are visible.\n- A List supports the selection of one or more List items.\n\n    ",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.PN=new A.j(7,{id:1677344499243,question:"What is the difference between a Scrollbar and a JScrollPane?",answer:"        \n- A **Scrollbar** is a Component, but not a Container. \n- A **ScrollPane** is a Container. \n- A ScrollPane handles its own events and performs\nits own scrolling.\n\n    ",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.NX=new A.j(7,{id:1677344545527,question:"What is the relationship between clipping and repainting?",answer:"\n- When a window is repainted by the AWT painting thread, it sets the clipping regions to the area of the window that requires\nrepainting.\n",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.NP=new A.j(7,{id:1677344584794,question:"What is the relationship between an event-listener interface and an eventadapter class?",answer:"\n- An event-listener interface defines the methods that must be implemented by an event handler for a particular event. \n- An event\nadapter provides a default implementation of an event-listener interface.\n",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Og=new A.j(7,{id:1677344621098,question:"What advantage do Java\u2019s layout managers provide over traditional windowing systems?",answer:"\n- Java uses layout managers to lay out components in a consistent manner, across all windowing platforms. \n- Since layout managers aren\u2019t tied to absolute sizing and positioning, they are able to accomodate platform-specific differences among windowing\nsystems.\n",category:"Java",topic:"Swing",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.PX=new A.j(7,{id:1677344741504,question:"What is JDBC? Explain the role of Driver in JDBC.",answer:"**JDBC**\n- It is an abstraction layer that allows users to choose between databases. \n- JDBC enables developers to write database applications in Java, without having to concern themselves with the underlying details of a particular database\n\n**Role of Driver**\n- The JDBC Driver provides vendor-specific implementations of the abstract classes provided by the JDBC API. \n- Each driver\nmust provide implementations for the following classes of the java.sql package:Connection, Statement, PreparedStatement,\nCallableStatement, ResultSet and Driver.\n",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Me=new A.j(7,{id:1677344849281,question:"What is the purpose Class.forName method?",answer:"\nThis method is used to method is used to load the driver that will establish a connection to the database.\n",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.N8=new A.j(7,{id:1677344901730,question:"What is the advantage of PreparedStatement over Statement?",answer:"\n- PreparedStatements are precompiled and thus, their performance is much better. \n- Also, PreparedStatement objects can be reused\nwith different input values to their queries.\n",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.ME=new A.j(7,{id:1677344975438,question:"What is the use of CallableStatement ? Name the method, which is used to prepare a CallableStatement.",answer:"\n- A CallableStatement is used to execute stored procedures. \n- Stored procedures are stored and offered by a database. \n- Stored procedures may take input values from the user and may return a result. \n- The usage of stored procedures is highly encouraged,\nbecause it offers security and modularity.\n- The method that prepares a CallableStatement is the following: \n```\nCallableStament.prepareCall();\n```",category:"Java",topic:"JDBC",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.NW=new A.j(7,{id:1677345031826,question:"What does Connection pooling mean?",answer:"\n- The interaction with a database can be costly, regarding the opening and closing of database connections. \n- Especially, when the\nnumber of database clients increases, this cost is very high and a large number of resources is consumed.\n- A pool of database\nconnections is obtained at start up by the application server and is maintained in a pool. \n- A request for a connection is served by a\nconnection residing in the pool. \n- In the end of the connection, the request is returned to the pool and can be used to satisfy future\nrequests.\n",category:"Java",topic:"JDBC",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Nf=new A.j(7,{id:1677345326472,question:"What is RMI?",answer:"\n- The Java Remote Method Invocation (Java RMI) is a Java API that performs the object-oriented equivalent of remote procedure\ncalls (RPC), with support for direct transfer of serialized Java classes and distributed garbage collection. \n- Remote Method Invocation (RMI) can also be seen as the process of activating a method on a remotely running object. \n- RMI offers location transparency\nbecause a user feels that a method is executed on a locally running object. C\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Ns=new A.j(7,{id:1677345367674,question:"What is the basic principle of RMI architecture?",answer:"\n- The RMI architecture is based on a very important principle which states that the definition of the behavior and the implementation of that behavior, are separate concepts. \n- RMI allows the code that defines the behavior and the code that implements the\nbehavior to remain separate and to run on separate JVMs\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Pv=new A.j(7,{id:1677345423440,question:"What are the layers of RMI Architecture?",answer:"\nThe RMI architecture consists of the following layers:\n\n\u2022 **Stub and Skeleton layer**: This layer lies just beneath the view of the developer. This layer is responsible for intercepting\nmethod calls made by the client to the interface and redirect these calls to a remote RMI Service.\n\n\u2022 **Remote Reference Layer**: The second layer of the RMI architecture deals with the interpretation of references made from\nthe client to the server\u2019s remote objects. This layer interprets and manages references made from clients to the remote service\nobjects. The connection is a one-to-one (unicast) link.\n\n\u2022 **Transport layer**: This layer is responsible for connecting the two JVM participating in the service. This layer is based on\nTCP/IP connections between machines in a network. It provides basic connectivity, as well as some firewall penetration\nstrategies.\n",category:"Android",topic:"Remote Method Invocation",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Qc=new A.j(7,{id:1677345478968,question:"What is the role of Remote Interface in RMI?",answer:"\n- The Remote interface serves to identify interfaces whose methods may be invoked from a non-local virtual machine. \n- Any object\nthat is a remote object must directly or indirectly implement this interface. \n- A class that implements a remote interface should\ndeclare the remote interfaces being implemented, define the constructor for each remote object and provide an implementation\nfor each remote method in all remote interfaces.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Qx=new A.j(7,{id:1677345533950,question:"What is the difference between using bind() and rebind() methods of Naming Class?",answer:"\n- The bind method bind is responsible for binding the specified name to a remote object, while the rebind method is responsible\nfor rebinding the specified name to a new remote object. \n- In case a binding exists for that name, the binding is replaced.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.P8=new A.j(7,{id:1677345592169,question:"What are the steps involved to make work a RMI program?",answer:"\nThe following steps must be involved in order for a RMI program to work properly:\n\n\u2022 Compilation of all source files.\n\n\u2022 Generatation of the stubs using rmic.\n\n\u2022 Start the rmiregistry.\n\n\u2022 Start the RMIServer.\n\n\u2022 Run the client program.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Kshitj Seth"},B.e,t.M)
B.Mp=new A.j(7,{id:1677345676190,question:"What is the role of stub in RMI?",answer:"\nA stub for a remote object acts as a client\u2019s local representative or proxy for the remote object. The caller invokes a method on\nthe local stub, which is responsible for executing the method on the remote object. When a stub\u2019s method is invoked, it undergoes\nthe following steps:\n\n\u2022 It initiates a connection to the remote JVM containing the remote object.\n\n\u2022 It marshals the parameters to the remote JVM.\n\n\u2022 It waits for the result of the method invocation and execution.\n\n\u2022 It unmarshals the return value or an exception if the method has not been successfully \nexecuted.\n\n\u2022 It returns the value to the caller\n",category:"Java",topic:"Remote Method Invocation",level:1,uploader:"Kshitj Seth"},B.e,t.M)
B.Oh=new A.j(7,{id:1677345731608,question:"What is DGC? And how does it work?",answer:"\n- DGC stands for Distributed Garbage Collection. Remote Method Invocation (RMI) uses DGC for automatic garbage collection.\n- Since RMI involves remote object references across JVM\u2019s, garbage collection can be quite difficult. \n- DGC uses a reference\ncounting algorithm to provide automatic memory management for remote objects.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Or=new A.j(7,{id:1677345779811,question:"What is the purpose of using RMISecurityManager in RMI?",answer:"\n- RMISecurityManager provides a security manager that can be used by RMI applications, which use downloaded code. \n- The class\nloader of RMI will not download any classes from remote locations, if the security manager has not been set.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Pw=new A.j(7,{id:1677345831996,question:"Explain Marshalling and demarshalling.",answer:"\n- When an application wants to pass its memory objects across a network to another host or persist it to storage, the in-memory\nrepresentation must be converted to a suitable format. \n- This process is called marshalling and the revert operation is called\ndemarshalling.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.MQ=new A.j(7,{id:1677345884121,question:"Explain Serialization and Deserialization.",answer:"\n- Java provides a mechanism, called object serialization where an object can be represented as a sequence of bytes and includes\nthe object\u2019s data, as well as information about the object\u2019s type, and the types of data stored in the object. \n- Thus, serialization can\nbe seen as a way of flattening objects, in order to be stored on disk, and later, read back and reconstituted. \n- Deserialisation is the\nreverse process of converting an object from its flattened state to a live object.\n",category:"Java",topic:"Remote Method Invocation",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Mg=new A.j(7,{id:1677346023513,question:"What is a Servlet? Explain the architecture of a Servlet.",answer:"**Servlets**\n\n- The servlet is a Java programming language class used to process client requests and generate dynamic web content. \n- Servlets are\nmostly used to process or store data submitted by an HTML form, provide dynamic content and manage state information that\ndoes not exist in the stateless HTTP protocol.\n\n**Architecture**\n\n- The core abstraction that must be implemented by all servlets is the javax.servlet.Servlet interface. \n- Each servlet must implement\nit either directly or indirectly, either by extending javax.servlet.GenericServlet or javax.servlet.http.HTTPServlet. \n- Finally, each\nservlet is able to serve multiple requests in parallel using multithreading.\n",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Pq=new A.j(7,{id:1677398116602,question:"What is the difference between an Applet and a Servlet?",answer:"\n- An Applet is a client side java program that runs within a Web browser on the client machine. - On the other hand, a servlet is a server side component that runs on the web server.\n- An applet can use the user interface classes, while a servlet does not have a user interface. \n- Instead, a servlet waits for client\u2019s HTTP requests and generates a response in every request.        \n\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.N2=new A.j(7,{id:1677398188669,question:"What is the difference between GenericServlet and HttpServlet?",answer:"        \n- GenericServlet is a generalized and protocol-independent servlet that implements the Servlet and ServletConfig interfaces. \n- Those servlets extending the GenericServlet class shall override the service method. \n- Finally, in order to develop an HTTP servlet for use on the Web that serves requests using the HTTP protocol, your servlet must extend the HttpServlet instead.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.QE=new A.j(7,{id:1677398295857,question:"Explain the life cycle of a Servlet.",answer:"        \n- On every client\u2019s request, the Servlet Engine loads the servlets and invokes its init methods, in order for the servlet to be initialized. \n- Then, the Servlet object handles all subsequent requests coming from that client, by invoking the service method for each request separately. \n- Finally, the servlet is removed by calling the server\u2019s destroy method.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nk=new A.j(7,{id:1677398405803,question:"What is the difference between doGet() and doPost()?",answer:"        \n**doGET**: The GET method appends the name-value pairs on the request\u2019s URL. Thus, there is a limit on the number of characters and subsequently on the number of values that can be used in a client\u2019s request. Furthermore, the values of the request are made visible and thus, sensitive information must not be passed in that way.\n\n**doPOST**: The POST method overcomes the limit imposed by the GET request, by sending the values of the request inside its body. Also, there is no limitations on the number of values to be sent across. Finally, the sensitive information passed through a POST request is not visible to an external client.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OX=new A.j(7,{id:1677398490341,question:"What is the structure of the HTTP response?",answer:"        \nThe HTTP response consists of three parts:\n\n\u2022 **Status Code**: describes the status of the response. It can be used to check if the request has been successfully completed. In case the request failed, the status code can be used to find out the reason behind the failure. If your servlet does not return a status code, the success status code, HttpServletResponse.SC_OK, is returned by default.\n\n\u2022 **HTTP Headers**: they contain more information about the response. For example, the headers may specify the date/time after which the response is considered stale, or the form of encoding used to safely transfer the entity to the user.\n\n\u2022 **Body**: it contains the content of the response. The body may contain HTML code, an image, etc. The body consists of the data bytes transmitted in an HTTP transaction message immediately following the headers.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.NZ=new A.j(7,{id:1677398568933,question:"What is a cookie? What is the difference between session and cookie?",answer:"        \n\nA cookie is a bit of information that the Web server sends to the browser. The browser stores the cookies for each Web server in a local file. In a future request, the browser, along with the request, sends all stored cookies for that specific Web server.The differences between session and a cookie are the following:\n\n\u2022 The session should work, regardless of the settings on the client browser. The client may have chosen to disable cookies. However, the sessions still work, as the client has no ability to disable them in the server side.\n\n\u2022 The session and cookies also differ in the amount of information the can store. The HTTP session is capable of storing any Java object, while a cookie can only store String objects\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Qg=new A.j(7,{id:1677398641874,question:"What\u2019s the difference between sendRedirect and forward methods?",answer:"        \n- The sendRedirect method creates a new request, while the forward method just forwards a request to a new target. \n- The previous request scope objects are not available after a redirect, because it results in a new request. \n- On the other hand, the previous request scope objects are available after forwarding.\n-  FInally, in general, the sendRedirect method is considered to be slower compare to the forward method.\n\n    ",category:"Java",topic:"Servlets",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Qw=new A.j(7,{id:1677398837295,question:"What is a JSP Page? ",answer:"        \n- A Java Server Page (JSP) is a text document that contains two types of text: static data and JSP elements. \n- Static data can be expressed in any text-based format, such as HTML or XML. JSP is a technology that mixes static content with dynamically- generated content.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OV=new A.j(7,{id:1677398898406,question:"What are the advantages of JSP?",answer:"        \nThe advantages of using the JSP technology are shown below:\n\n\u2022 JSP pages are dynamically compiled into servlets and thus, the developers can easily make updates to presentation code.\n\n\u2022 JSP pages can be pre-compiled.\n\n\u2022 JSP pages can be easily combined to static templates, including HTML or XML fragments, with code that generates dynamic content.\n\n\u2022 Developers can offer customized JSP tag libraries that page authors access using an XML-like syntax.\n\n\u2022Developerscanmakelogicchangesatthecomponentlevel,withouteditingtheindividualpagesthatusetheapplication\u2019slogic.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nm=new A.j(7,{id:1677399114748,question:"What are Directives? What are the different types of Directives available in JSP?",answer:"\n- Directives are instructions that are processed by the JSP engine, when the page is compiled to a servlet. \n- Directives are used to setpage-level instructions,insert data from external files, and specify custom tag libraries.\n- Directives are defined between < %@ and % >.\n- The different types of directives are shown below:\n\n- Include directive: it is used to include a file and merges the content of the file with the current page. \n\n- Page directive: it is used to define specific attributes in the JSP page, like error page and buffer.\n\n- Taglib: it is used to declare a custom tag library which is used in the page.\n",category:"Java",topic:"JSP",level:1,uploader:"Jayesh Thakkar"},B.e,t.M)
B.OG=new A.j(7,{id:1677399190029,question:"What are JSP actions?",answer:"        \nJSP actions use constructs in XML syntax to control the behavior of the servlet engine. JSP actions are executed when a JSP page is requested. \n\nThey can be dynamically inserted into a file, re-use JavaBeans components, forward the user to another page, or generate HTML for the Java plugin.\nSome of the available actions are listed below:\n\n\u2022 jsp:include - includes a file, when the JSP page is requested. \n\n\u2022 jsp:useBean - finds or instantiates a JavaBean.\n\n\u2022 jsp:setProperty - sets the property of a JavaBean.\n\n\u2022 jsp:getProperty - gets the property of a JavaBean.\n\n\u2022 jsp:forward - forwards the requester to a new page. \n\n\u2022 jsp:plugin - generates browser-specific code.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.QM=new A.j(7,{id:1677399386872,question:"Explain Scriptlets, Decalarations, Expressions.",answer:"      \n**Scriptlets-**  In Java Server Pages (JSP) technology, a scriptlet is a piece of Java-code embedded in a JSP page. The scriptlet is everything inside the tags. Between these tags, a user can add any valid scriplet.\n\n**Decalarations-**\nDeclarations are similar to variable declarations in Java. Declarations are used to declare variables for subsequent use in expres- sions or scriptlets. To add a declaration, you must use the sequences to enclose your declarations.\n\n**Expressions-**\nA JSP expression is used to insert the value of a scripting language expression, converted into a string, into the data stream returned to the client, by the webserver. Expressions are defined between < %  = and % > tags.\n\n    ",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Qe=new A.j(7,{id:1677399468998,question:"What is meant by implicit objects and what are they?",answer:"        \nJSP implicit objects are those Java objects that the JSP Container makes available to developers in each page. \n\nA developer can call them directly, without being explicitly declared. JSP Implicit Objects are also called pre-defined variables.The following objects are considered implicit in a JSP page:\n\n\u2022 application \n\n\u2022 page\n\n\u2022 request\n\n\u2022 response    \n\n\u2022 session\n\n\u2022 exception\n\n\u2022 out\n\n\u2022 config\n\n\u2022 pageContext",category:"Java",topic:"JSP",level:0,uploader:"Jayesh Thakkar"},B.e,t.M)
B.Nh=new A.j(7,{id:1677482745582,question:"What is debouncing and throttling in JavaScript?",answer:"        \nDebouncing and Throttling are programming concepts that can be used to optimize performance in JavaScript. In case multiple events of the same type are occurring, debouncing and throttling allow us to reduce the number of times the event handlers are triggered.\n\n**Debouncing**\n\nDebouncing works by grouping function calls and calling them only after a predefined amount of time has passed since the last call.\n\nExample\nIf a page is scrolled, instead of calling the scroll event handler for every scroll event, debounce can help group these calls and call it once after, let's say, 50 milliseconds since the last scroll event. This would keep the scroll smooth without getting affected by the handler.\n\n\n**Throttling**\n\nThrottling is a similar concept to debouncing. Throttling works by not allowing any function call for a predefined amount of time after a function call.\n\nExample\nIf a button is pressed 10 times in a single second, we would not want the event handler to be triggered 10 times as the handling might be expensive. We can use throttling to restrict the event handler from getting triggered for 1 second since the previous trigger.\n\nDebouncing vs Throttling\nThe major difference between Debouncing and Throttling is that in the case of debouncing the function call would happen only after the last event whereas in the case of throttling the function call can happen after every X milliseconds if continuous events are happening.\n\n\n\n    ",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Gobind Sekhar"},B.e,t.M)
B.OK=new A.j(7,{id:1677483453735,question:"What are the different scopes in JavaScript?",answer:"\nIn JavaScript, scope gives the context about the accessibility of a variable or function in the code. There are three types of scope based on which a function or a variable can be accessed. They are:\n\n- Global Scope\n- Function/Local Scope\n- Block Scope\n\n**Global Scope**\n\nThe variables or functions that are declared in the global scope can be accessed anywhere in the code.\n\nExample\n```\nconst name = 'thedevinterview';\nfunction printName() {\n    console.log(name);\n}\nprintName();\n```\n ",category:"Web Frontend",topic:"Javascript",level:0,uploader:"Rohan Patil"},B.e,t.M)
B.Po=new A.j(7,{id:1677484115468,question:"What are call(), apply() and bind() methods in JavaScript?",answer:'\n**call() Method**\n\nThe call() is a method in JavaScript that helps us to call a function with a given object as the \'this\' value. The call() method takes all the arguments individually.\n\nSyntax\n```\nfunctionName.call(thisArgument, ...functionArgs);\n```\nExample\n```\nconst personOne = {\n  firstName : "Elon",\n  secondName : "Musk"\n}\n\nconst getFullName = function(company, country) {\n  console.log(this.firstName + " " + this.secondName + ", " + company + ", " + country);\n}\n\nconst personTwo = {\n  firstName : "Mark",\n  secondName : "Zuckerburg"\n}\n\ngetFullName.call(personOne, "Tesla", "United States");    // outputs Elon Musk, Tesla, United States\ngetFullName.call(personTwo, "Facebook", "United States");    // outputs Mark Zuckerberg, Facebook, United States\n```\n\n**apply() Method**\n\nThe apply() method is similar to the call() method. The only difference is that the apply() method takes an array as the argument whereas they were taken individually as arguments in the case of the call() method.\n\nSyntax\n```\nfunctionName.apply(thisArgument, functionArgsArray);\n```\nExample\n```\nconst personOne = {\n  firstName : "Elon",\n  secondName : "Musk"\n}\n\nconst getFullName = function(company, country) {\n  console.log(this.firstName + " " + this.secondName + ", " + company + ", " + country);\n}\n\nconst personTwo = {\n  firstName : "Mark",\n  secondName : "Zuckerburg"\n}\n\ngetFullName.apply(personOne, ["Tesla", "United States"]);    // outputs Elon Musk, Tesla, United States\ngetFullName.apply(personTwo, ["Facebook", "United States"]);    // outputs Mark Zuckerberg, Facebook, United States\n```\n\nIn the above example, the company and country parameters were passed as a single array. It was passed individually in the case of the call() method. \n\n**bind() Method**\n\nThe bind() method is used to create a new function from another function with a given object as the this argument. It creates a copy of the function and then binds it to the object for which it was called. It does not immediately invoke the function and the new copy needs to be invoked separately. \n\nExample\n\n```\nconst personOne = {\n  firstName : "Elon",\n  secondName : "Musk"\n}\n\nconst getFullName = function(company, country) {\n  console.log(this.firstName + " " + this.secondName + ", " + company + ", " + country);\n}\n\nconst getPersonOneDetails = getFullName.bind(personOne, ["Tesla", "United States"]); \ngetPersonOneDetails();    // outputs Elon Musk, Tesla, United States\n```\nIn the above example, calling the bind method on \'getFullName\' creates a copy of it, which is assigned to \'getPersonOneDetails\'. When the \'getPersonOneDetails\' is called separately, we will get the desired output.\n',category:"Web Frontend",topic:"Javascript",level:0,uploader:"Rohan Patil"},B.e,t.M)
B.Qj=new A.j(7,{id:1677666896916,question:"Compare Splunk with Spark.",answer:"![enter image description here](https://i.postimg.cc/C5h6W6Y0/Screenshot-2023-03-01-at-4-04-00-PM.png)\n\n",category:"Data Engineer",topic:"Splunk",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Qq=new A.j(7,{id:1677667031808,question:"What is Splunk? What are the common port numbers used by Splunk?",answer:"\n- Splunk is \u2018Google\u2019 for our machine-generated data. \n- It\u2019s a software/engine that can be used for searching, visualizing, monitoring, reporting, etc. of our enterprise data. \n- Splunk takes valuable machine data and turns it into powerful operational intelligence by providing real-time insights into our data through charts, alerts, reports, etc.\n\n![ports](https://i.postimg.cc/D0SYv4Wp/Screenshot-2023-03-01-at-4-05-38-PM.png)\n",category:"Data Engineer",topic:"Splunk",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Mz=new A.j(7,{id:1677667105552,question:"What is a Splunk Forwarder? What are the types of Splunk Forwarders?\n",answer:"\nThere are two types of Splunk Forwarders as below:\n\n**Universal Forwarder (UF)**: The Splunk agent installed on a non-Splunk system to gather data locally; it can\u2019t parse or index data.\n\n**Heavyweight Forwarder (HWF)**: A full instance of Splunk with advanced functionalities.\nIt generally works as a remote collector, intermediate forwarder, and possible data filter, and since it parses data, it is not recommended for production systems.\n\n\n",category:"Data Engineer",topic:"Splunk",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.M9=new A.j(7,{id:1677667196488,question:"Name some important configuration files in Splunk.",answer:"They are as follows: \n- props.conf\n- indexes.conf\n- inputs.conf\n- transforms.conf\n- server.conf\n",category:"Data Engineer",topic:"Splunk",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.OT=new A.j(7,{id:1677667235178,question:"What is Summary Index in Splunk?",answer:"\nA summary index is the default Splunk index (the index that Splunk Enterprise uses if we do not indicate another one).\n\nIf we plan to run a variety of summary index reports, we may need to create additional summary indexes.\n",category:"Data Engineer",topic:"Splunk",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Q8=new A.j(7,{id:1677667292381,question:"Can you write down a general regular expression for extracting the IP address from logs?",answer:'\nThere are multiple ways in which we can extract the IP address from logs. Below are a few examples:\n\nBy using a regular expression:\n```\nrex field=_raw  "(?<ip_address>\\d+\\.\\d+\\.\\d+\\.\\d+)"\n```\nOR\n```\nrex field=_raw  "(?<ip_address>([0-9]{1,3}[\\.]){3}[0-9]{1,3})"\n```',category:"Data Engineer",topic:"Splunk",level:1,uploader:"Atharv Patil"},B.e,t.M)
B.MD=new A.j(7,{id:1677667359449,question:"Explain Stats vs Transaction commands.",answer:"\nThis is another frequently asked interview question on Splunk which will test Developer or Engineers knowledge. The transaction command is the most useful in two specific cases:\n\n- When the unique ID (from one or more fields) alone is not sufficient to discriminate between two transactions. This is the case when the identifier is reused, for example, web sessions identified by a cookie/client IP. In this case, the time span or pauses are also used to segment the data into transactions.\n- When an identifier is reused, say in DHCP logs, a particular message identifies the beginning or end of a transaction.\n- When it is desirable to see the raw text of events combined rather than an analysis of the constituent fields of the events.\n\nIn other cases, it\u2019s usually better to use stats.\n\n- As the performance of the stats command is higher, it can be used especially in a distributed search environment\n\nIf there is a unique ID, the stats command can be used\n",category:"Data Engineer",topic:"Splunk",level:1,uploader:"Atharv Patil"},B.e,t.M)
B.Pl=new A.j(7,{id:1677667433328,question:"How to troubleshoot Splunk performance issues?",answer:"\nThe answer to this question would be very wide, but mostly an interviewer would be looking for the following keywords:\n\n- Check splunkd.log for errors\n- Check server performance issues, i.e., CPU, memory usage, disk I/O, etc.\n- Install the SOS (Splunk on Splunk) app and check for warnings and errors in its dashboard\n- Check the number of saved searches currently running and their consumption of system resources\n- Install and enable Firebug, a Firefox extension. Log into Splunk (using Firefox) and open Firebug\u2019s panels. Then, switch to the \u2018Net\u2019 panel (we will have to enable it). The Net panel will show us the HTTP requests and responses, along with the time spent in each. This will give us a lot of information quickly such as which requests are hanging Splunk, which requests are blameless, etc.\n",category:"Data Engineer",topic:"Splunk",level:1,uploader:"Atharv Patil"},B.e,t.M)
B.Py=new A.j(7,{id:1677667523345,question:"What are Buckets? Explain Splunk Bucket Lifecycle.",answer:"\nSplunk places indexed data in directories, called \u2018buckets.\u2019 It is physically a directory containing events of a certain period.\n\nA bucket moves through several stages as it ages. Below are the various stages it goes through:\n\n- **Hot**: A hot bucket contains newly indexed data. It is open for writing. There can be one or more hot buckets for each index.\nWarm: A warm bucket consists of data rolled out from a hot bucket. There are many warm buckets.\n- **Cold**: A cold bucket has data that is rolled out from a warm bucket. There are many cold buckets.\n- **Frozen**: A frozen bucket is comprised of data rolled out from a cold bucket. The indexer deletes frozen data by default, but we can archive it. Archived data can later be thawed (data in a frozen bucket is not searchable).\nBy default, the buckets are located in:\n```\n$SPLUNK_HOME/var/lib/splunk/defaultdb/db\n```\nWe should see the hot-db there, and any warm buckets we have. By default, Splunk sets the bucket size to 10 GB for 64-bit systems and 750 MB for 32-bit systems.\n",category:"Data Engineer",topic:"Splunk",level:1,uploader:"Atharv Patil"},B.e,t.M)
B.QC=new A.j(7,{id:1677667735886,question:"How to reset Splunk Admin password?",answer:"\nResetting the Splunk Admin password depends on the version of Splunk. If we are using Splunk 7.1 and above, then we have to follow the below steps:\n\n- First, we have to stop our Splunk Enterprise\n- Now, we need to find the \u2018passwd\u2019 file and rename it to \u2018passwd.bk\u2019\n- Then, we have to create a file named \u2018user-seed.conf\u2019 in the below directory:\n```\n$SPLUNK_HOME/etc/system/local/\n```\nIn the file, we will have to use the following command (here, in the place of \u2018NEW_PASSWORD\u2019, we will add our own new password):\n\n```\n[user_info]\nPASSWORD = NEW_PASSWORD\n```\nAfter that, we can just restart the Splunk Enterprise and use the new password to log in\nNow, if we are using the versions prior to 7.1, we will follow the below steps:\n\n- First, stop the Splunk Enterprise\n- Find the passwd file and rename it to \u2018passw.bk\u2019\n- Start Splunk Enterprise and log in using the default credentials of admin/changeme\n- Here, when asked to enter a new password for our admin account, we will follow the instructions\nNote: In case we have created other users earlier and know their login details, copy and paste their credentials from the passwd.bk file into the passwd file and restart Splunk.\n\n\n",category:"Data Engineer",topic:"Splunk",level:2,uploader:"Atharv Patil"},B.e,t.M)
B.Pf=new A.j(7,{id:1677667792834,question:"What is .conf files precedence in Splunk?",answer:"\nFile precedence is as follows:\n\n1. System local directory \u2014 highest priority\n\n2. App local directories\n\n3. App default directories\n\n4. System default directory \u2014 lowest priority\n",category:"Data Engineer",topic:"Splunk",level:2,uploader:"Atharv Patil"},B.e,t.M)
B.PE=new A.j(7,{id:1677667992009,question:"How do I exclude some events from being indexed by Splunk?",answer:"\nThis can be done by defining a regex to match the necessary event(s) and sending everything else to NullQueue. Here is a basic example that will drop everything except events that contain the string login:\n\n**In props.conf:**\n\n```\n<code>[source::/var/log/foo]\n\n# Transforms must be applied in this order\n\n# to make sure events are dropped on the\n\n# floor prior to making their way to the\n\n# index processor\n\nTRANSFORMS-set= setnull,setparsing\n\n</code>\n```\n\n**In transforms.conf:**\n\n```\n[setnull] REGEX = . DEST_KEY = queue FORMAT = nullQueue\n\n[setparsing]\n\nREGEX = login\n\nDEST_KEY = queue\n\nFORMAT = indexQueue\n```",category:"Data Engineer",topic:"Splunk",level:2,uploader:"Atharv Patil"},B.e,t.M)
B.OF=new A.j(7,{id:1677668147445,question:"What are the elements of Kafka?",answer:"\nThe most important elements of Kafka are as follows:\n\n- **Topic**: It is a bunch of similar kinds of messages.\n- **Producer**: Using this, one can issue communications to the topic.\n- **Consumer**: It endures to a variety of topics and takes data from brokers.\n- **Broker**: This is the place where the issued messages are stored.\n",category:"Data Engineer",topic:"Kafka",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.Mf=new A.j(7,{id:1677668250518,question:"What role does ZooKeeper play in a cluster of Kafka?",answer:"\nApache ZooKeeper acts as a distributed, open-source configuration and synchronization service, along with being a naming registry for distributed applications. It keeps track of the status of the Kafka cluster nodes, as well as of Kafka topics, partitions, etc.\n\nSince the data is divided across collections of nodes within ZooKeeper, it exhibits high availability and consistency. When a node fails, ZooKeeper performs an instant failover migration.\n\nZooKeeper is used in Kafka for managing service discovery for Kafka brokers, which form the cluster. ZooKeeper communicates with Kafka when a new broker joins, when a broker dies, when a topic gets removed, or when a topic is added so that each node in the cluster knows about these changes. Thus, it provides an in-sync view of the Kafka cluster configuration.\n",category:"Data Engineer",topic:"Kafka",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.OQ=new A.j(7,{id:1677668306904,question:"Why do you think the replications to be dangerous in Kafka?",answer:"Duplication assures that the issued messages available are absorbed in the case of any appliance mistake, plan fault, or recurrent software promotions.",category:"Data Engineer",topic:"Kafka",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.QF=new A.j(7,{id:1677671819688,question:"Distinguish between Kafka and Flume?",answer:"\n- Flume\u2019s major use case is to gulp down data into Hadoop.\n- Flume is incorporated with Hadoop\u2019s monitoring system, file formats, file system, and utilities such as Morphlines. \n- Along with Flume\u2019s design of sinks, sources, and channels, Flume can help one shift data to other systems lithely. \n- However, the main feature of Hadoop is its Hadoop integration. \n- Flume is the best option to use when we have non-relational data sources or a long file to stream into Hadoop.\n\n- On the other hand, Kafka\u2019s major use case is a distributed publish\u2013subscribe messaging system. \n- It is not developed specifically for Hadoop, and using Kafka to read and write data to Hadoop is considerably trickier than it is with Flume. \n- Kafka can be used when we particularly need a highly reliable and scalable enterprise messaging system to connect multiple systems like Hadoop.\n",category:"Data Engineer",topic:"Kafka",level:1,uploader:"Narayana Kailash"},B.e,t.M)
B.PV=new A.j(7,{id:1677671872113,question:"What major role does a Kafka Producer API play?",answer:"\n- It is responsible for covering two producers: kafka.producer.SyncProducer and kafka.producer.async.AsyncProducer. \n- Kafka Producer API mainly provides all producer performance to its clients through a single API.\n",category:"Data Engineer",topic:"Kafka",level:1,uploader:"Narayana Kailash"},B.e,t.M)
B.Qt=new A.j(7,{id:1677671908559,question:"Describe partitioning key.",answer:"\nIts role is to specify the target divider of the memo within the producer. Usually, a hash-oriented divider concludes the divider ID according to the given factors. Consumers also use tailored partitions.\n\n\n",category:"Data Engineer",topic:"Kafka",level:0,uploader:"Narayana Kailash"},B.e,t.M)
B.NM=new A.j(7,{id:1677673020559,question:"Explain the architecture of Kafka.",answer:"\n- In Kafka, a cluster contains multiple brokers since it is a distributed system. \n- Topic in the system will get divided into multiple partitions, and each broker stores one or more of those partitions so that multiple producers and consumers can publish and retrieve messages at the same time.\n\n**Data Ecosystem**: Several applications that use Apache Kafka forms an ecosystem. This ecosystem is built for data processing. It takes inputs in the form of applications that create data, and outputs are defined in the form of metrics, reports, etc.\n\n**Kafka Cluster**: A Kafka cluster is a system that comprises of different brokers, topics, and their respective partitions. Data is written to the topic within the cluster and read by the cluster itself.\n\n\n**Producers**: A producer sends or writes data/messages to the topic within the cluster. In order to store a huge amount of data, different producers within an application send data to the Kafka cluster.\n\n\n**Consumers**: A consumer is the one that reads or consumes messages from the Kafka cluster. There can be several consumers consuming different types of data form the cluster. The beauty of Kafka is that each consumer knows from where it needs to consume the data.\nBrokers: A Kafka server is known as a broker. A broker is a bridge between producers and consumers. If a producer wishes to write data to the cluster, it is sent to the Kafka server. All brokers lie within a Kafka cluster itself. Also, there can be multiple brokers.\n\n\n**Topics**: It is a common name or a heading given to represent a similar type of data. In Apache Kafka, there can be multiple topics in a cluster. Each topic specifies different types of messages.\n\n\n**Partitions**: The data or message is divided into small subparts, known as partitions. Each partition carries data within it having an offset value. The data is always written in a sequential manner. We can have an infinite number of partitions with infinite offset values. However, it is not guaranteed that to which partition the message will be written.\n\n\n**ZooKeeper**: A ZooKeeper is used to store information about the Kafka cluster and details of the consumer clients. It manages brokers by maintaining a list of them. Also, a ZooKeeper is responsible for choosing a leader for the partitions. If any changes like a broker die, new topics, etc., occurs, the ZooKeeper sends notifications to Apache Kafka. A ZooKeeper is designed to operate with an odd number of Kafka servers. Zookeeper has a leader server that handles all the writes, and rest of the servers are the followers who handle all the reads. However, a user does not directly interact with the Zookeeper, but via brokers. No Kafka server can run without a zookeeper server. It is mandatory to run the zookeeper server.\n\n\n![enter image description here](https://i.postimg.cc/W385c4Cd/apache-kafka-architecture3.png)",category:"Data Engineer",topic:"Kafka",level:1,uploader:"Narayana Kailash"},B.e,t.M)
B.N7=new A.j(7,{id:1677673105123,question:"What is MapReduce?",answer:"\nReferred as the core of Hadoop, MapReduce is a programming framework to process large sets of data or big data across thousands of servers in a Hadoop Cluster. The concept of MapReduce is similar to the cluster scale-out data processing systems. The term MapReduce refers to two important processes of Hadoop program operates.\n\nFirst is the map() job, which converts a set of data into another breaking down individual elements into key/value pairs (tuples). Then comes reduce() job into play, wherein the output from the map, i.e. the tuples serve as the input and are combined into smaller set of tuples. As the name suggests, the map job every time occurs before the reduce one.\n",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Q1=new A.j(7,{id:1677673161748,question:"What are the main components of MapReduce Job?",answer:"\nMain Driver Class: providing job configuration parameters\nMapper Class: must extend org.apache.hadoop.mapreduce.Mapper class and performs execution of\n\n```\nmap() method\nReducer Class: must extend org.apache.hadoop.mapreduce.Reducer class\n```",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Nj=new A.j(7,{id:1677673196713,question:"What is Shuffling and Sorting in MapReduce?",answer:"\nShuffling and Sorting are two major processes operating simultaneously during the working of mapper and reducer.\n\nThe process of transferring data from Mapper to reducer is Shuffling. It is a mandatory operation for reducers to proceed their jobs further as the shuffling process serves as input for the reduce tasks.\n\nIn MapReduce, the output key-value pairs between the map and reduce phases (after the mapper) are automatically sorted before moving to the Reducer. This feature is helpful in programs where you need sorting at some stages. It also saves the programmer\u2019s overall time.\n",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Mi=new A.j(7,{id:1677673236160,question:"What is Partitioner and its usage?",answer:"\nPartitioner is yet another important phase that controls the partitioning of the intermediate map-reduce output keys using a hash function. The process of partitioning determines in what reducer, a key-value pair (of the map output) is sent. The number of partitions is equal to the total number of reduce jobs for the process.\n\nHash Partitioner is the default class available in Hadoop , which implements the following function.int getPartition(K key, V value, int numReduceTasks)\nThe function returns the partition number using the numReduceTasks is the number of fixed reducers.\n\n\n",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.NS=new A.j(7,{id:1677673267826,question:"What is Identity Mapper and Chain Mapper?",answer:"\nIdentity Mapper is the default Mapper class provided by Hadoop. when no other Mapper class is defined, Identify will be executed. It only writes the input data into output and do not perform and computations and calculations on the input data.\n\nThe class name is org.apache.hadoop.mapred.lib.IdentityMapper.\n\nChain Mapper is the implementation of simple Mapper class through chain operations across a set of Mapper classes, within a single map task. In this, the output from the first mapper becomes the input for second mapper and second mapper\u2019s output the input for third mapper and so on until the last mapper.\n\nThe class name is org.apache.hadoop.mapreduce.lib.ChainMapper.\n",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Mm=new A.j(7,{id:1677673307525,question:"What main configuration parameters are specified in MapReduce?",answer:"\nThe MapReduce programmers need to specify following configuration parameters to perform the map and reduce jobs:\n\n- The input location of the job in HDFs.\n- The output location of the job in HDFS.\n- The input\u2019s and output\u2019s format.\n- The classes containing map and reduce functions, respectively.\n- The .jar file for mapper, reducer and driver classes\n",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Atharv Patil"},B.e,t.M)
B.Mu=new A.j(7,{id:1677673343804,question:"What is InputFormat in Hadoop?",answer:"\nAnother important feature in MapReduce programming, InputFormat defines the input specifications for a job. It performs the following functions:\n\nValidates the input-specification of job.\nSplit the input file(s) into logical instances called InputSplit. Each of these split files are then assigned to individual Mapper.\nProvides implementation of RecordReader to extract input records from the above instances for further Mapper processing\n",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Ramesh Chauhan"},B.e,t.M)
B.Qo=new A.j(7,{id:1677673414737,question:"What is the difference between HDFS block and InputSplit?",answer:"\n- An HDFS block splits data into physical divisions while InputSplit in MapReduce splits input files logically.\n\n- While InputSplit is used to control number of mappers, the size of splits is user defined. On the contrary, the HDFS block size is fixed to 64 MB, i.e. for 1GB data , it will be **1GB/64MB = 16 splits/blocks.**\n-  However, if input split size is not defined by user, it takes the HDFS default block size.\n",category:"Data Engineer",topic:"Map Reduce",level:1,uploader:"Ramesh Chauhan"},B.e,t.M)
B.P7=new A.j(7,{id:1677673473227,question:"What is Text Input Format?",answer:"\n- It is the default InputFormat for plain text files in a given job having input files with .gz extension. \n- In TextInputFormat, files are broken into lines, wherein key is position in the file and value refers to the line of text.\n- Programmers can write their own InputFormat.\nThe hierarchy is:\n\n```\njava.lang.Object\norg.apache.hadoop.mapreduce.InputFormat<K,V>\norg.apache.hadoop.mapreduce.lib.input.FileInputFormat<LongWritable,Text>\norg.apache.hadoop.mapreduce.lib.input.TextInputFormat\n```",category:"Data Engineer",topic:"Map Reduce",level:0,uploader:"Ramesh Chauhan"},B.e,t.M)
B.Pe=new A.j(7,{id:1677673518519,question:"Explain JobConf in MapReduce.",answer:"- It is a primary interface to define a map-reduce job in the Hadoop for job execution. \n- JobConf specifies mapper, Combiner, partitioner, Reducer,InputFormat , OutputFormat implementations and other advanced job faets liek Comparators.",category:"Data Engineer",topic:"Map Reduce",level:1,uploader:"Ramesh Chauhan"},B.e,t.M)
B.OL=new A.j(7,{id:1677673569337,question:"Define Writable data types in MapReduce.",answer:"\n- Hadoop reads and writes data in a serialized form in writable interface. \n- The Writable interface has several classes like Text (storing String data), IntWritable, LongWriatble, FloatWritable, BooleanWritable. users are free to define their personal Writable classes as well.\n\n\n",category:"Data Engineer",topic:"Map Reduce",level:1,uploader:"Ramesh Chauhan"},B.e,t.M)
B.Mq=new A.j(7,{id:1677673614816,question:"What is OutputCommitter?",answer:"\nOutPutCommitter describes the commit of MapReduce task. FileOutputCommitter is the default available class available for OutputCommitter in MapReduce. It performs the following operations:\n\n- Create temporary output directory for the job during initialization.\n- Then, it cleans the job as in removes temporary output directory post job completion.\n- Sets up the task temporary output.\n- Identifies whether a task needs commit. The commit is applied if required.\n- JobSetup, JobCleanup and TaskCleanup are important tasks during output commit.\n\n",category:"Data Engineer",topic:"Map Reduce",level:2,uploader:"Atharv Patil"},B.e,t.M)
B.Qv=new A.j(7,{id:1677673671030,question:"What are the parameters of mappers and reducers?",answer:"\nThe four parameters for mappers are:\n\n- LongWritable (input)\n- text (input)\n- text (intermediate output)\n- IntWritable (intermediate output)\n\n\nThe four parameters for reducers are:\n\n- Text (intermediate output)\n- IntWritable (intermediate output)\n- Text (final output)\n- IntWritable (final output)\n",category:"Data Engineer",topic:"Map Reduce",level:2,uploader:"Atharv Patil"},B.e,t.M)
B.O7=new A.j(7,{id:1677673727039,question:"What are the key differences between Pig vs MapReduce?",answer:"\nPIG is a data flow language, the key focus of Pig is manage the flow of data from input source to output store. As part of managing this data flow it moves data feeding it to\n\n**process 1:** taking output and feeding it to\n\n**process 2:** The core features are preventing execution of subsequent stages if previous stage fails, manages temporary storage of data and most importantly compresses and rearranges processing steps for faster processing. While this can be done for any kind of processing tasks Pig is written specifically for managing data flow of Map reduce type of jobs. Most if not all jobs in a Pig are map reduce jobs or data movement jobs. Pig allows for custom functions to be added which can be used for processing in Pig, some default ones are like ordering, grouping, distinct, count etc.\n\nMapreduce on the other hand is a data processing paradigm, it is a framework for application developers to write code in so that its easily scaled to PB of tasks, this creates a separation between the developer that writes the application vs the developer that scales the application. Not all applications can be migrated to Map reduce but good few can be including complex ones like k-means to simple ones like counting uniques in a dataset.\n",category:"Data Engineer",topic:"Map Reduce",level:2,uploader:"Atharv Patil"},B.e,t.M)
B.Q7=new A.j(7,{id:1678183607428,question:"NAVI  | SDE-1  |  Bangalore  |  November 2021 ",answer:'\nAbout :Navi Technologies (erstwhile known as BACQ) is founded by Sachin Bansal & Ankit Agarwal to build consumer-centric and technology-driven businesses in the BFSI (Banking, Financial Services & Insurance) space.\n\nCompensation is quite good.\nLocation is Bangalore.\n\nNavi came to our campus for the role of SDE1. It was also open for placed students having offers with less than a particular CTC.\n\n**Round 1:** Online Test 48 questions,\nTime : 2 hours\n- Aptitude (20 questions ): profit Loss, mixtures, ratios and identities, series completion etc\n\n- Maths and Aptitude (25 questions): Aptitude question with similar difficulty.\nSection A, B had a total of 45 questions, and 40 minutes were given to complete.\n\nCoding Level A: \n\nTime: 50 minutes 2 question\n\n- 2 Questions. Both of them were easy. Implementation was a bit tricky for one of them.\n\nCoding Level B: \nTime: 30 Minutes\nGiven some numbers. Choose exactly k pairs and find the maximum abs of difference of the two numbers in every pair.N~ 10^3 afair.\nI did it through DP.\n\nCoding Questions were easy-medium. Time was very limited for aptitude/maths questions.\n\nPIs, platfrom was google meet.\n\n**Round 2:** Problem solving and Data structures\nAround 20 student shortlisted, 45 mins round\n\nInterviewer was very friendly person having total 5 YOE with 5 months in NAVI. First he introduce himself then took my introduction.\nThen asked my favourite DS. I told, I was not specific but let\u2019s go with arrays. He said if trees okay? I said yes. He asked me, what is complete tree. Donot know what I said but I was not confident. Then, I told him that there are complete,full and perfect binary trees coudlnot remember their details, this took a lot of time around 7-8 minutes. He said okay and said that I have total 35 mins mor(total 45) and will ask 2 ques if time permits then 3.\n\nHe, made a tree on google docs and,\nQ1. Find all node at k distance from root node.\nI took some time, did some clarification on output sequence and values of k. and told my dfs approach and its TC & SC. Then, he told me to write whole implementable code including making a tree in any IDE. Code gave wrong results initially. Figuring out and resolving 2 bugs, it satisfied him.\n\nQ2. How can I sort a linked list.\nI said, in naive way, I will store data in array sort it then assign it. Then I said marge sort is good. He said why not earlier one. Then I also introduce quick sort into the scene. Discussion became very confusing, he was asking about merge & quick sort on array & LL, then their TC and SC. I was taking time in giving answers, but I was clearly on the backfoot.\n\nQ3. Add 2 LL representing numbers.\n```\n// 1 -> 9 -> 9\n// 4 -> 5 -> 6 -> 7\n// 5 -> 4 -> 6 -> 8\n```\nI told im my approach and started coding.\nCode was good but made a very big blunder. Time was 12:43. He said me to take 3-4 more and modify. I removed a bug but he said that blinder was somewhere else.\n\nCorrect code is: ( Interview code had some bugs which I corrected here)\n```\nstruct  Node{\n\n  Node*next;\n  int data;\n\n  Node(int val)\n  {\n    next=NULL;;\n    data=val;\n  }\n\n};\nNode*addUtill(Node*head1,Node*head2,int carry)\n{\n  if(!head1 && !head2)\n  {\n    if(carry)\n      return new Node(carry);\n    else\n      return NULL;\n  }\n  int sum=0;\n  if(head1)\n    sum+=head1->data;\n  if(head2)\n    sum+=head2->data;\n  sum+=carry;\n\n  Node* cur= new Node(sum%10);\n\n  cur->next= addUtill(head1?head1->next:NULL,head2?head2->next:NULL,sum/10);\n\n  return cur;\n}\nNode* add(Node*head1,Node*head2)\n{\n    int sum=0,carry=0;\n    if(head1)\n      sum+=head1->data;\n    if(head2)\n      sum+=head2->data;\n    sum+=carry;\n\n    Node* cur= new Node(sum%10);\n\n    cur->next= addUtill(head1?head1->next:NULL,head2?head2->next:NULL,sum/10);\n    return cur;\n}\n\n\nint main() {\n  init_code();\n\n  Node*head1= new Node(1);\n  head1->next= new Node(9);\n  head1->next->next= new Node(9);\n\n  Node*head2= new Node(9);\n  head2->next= new Node(9);\n  head2->next->next= new Node(9);\n  head2->next->next->next= new Node(9);\n\n  Node* root= add(head1,head2);\n\n  Node*t=root;\n\n  while(t)\n  {\n    cout<<t->data<<" ";\n    t=t->next;\n  }\n\n   return 0;\n}\n```\nThen, he said that I had worked on mysql DB in intern, what DB I know. I said Oracle, SQL. He said, if I know about NoSQL DB. He asked me the difference. I told that data is stored in form of tables and relations in SQL DB while in form of key-value par(can store docs, objects, files) in NoSQL DB. He said what is difference bwn tables and relations ( I was behind weeket keeper now). Then said to write a SQL query.\n\nQ4. Find name of employee getting highest salary from an EMP table.\nSelect Name from EMP\nWhere salary=(select max(salary)from EMP);\nThen said, find 3r heighest. I gave him logic to find heighest then remove it from all salaries, do this one more time and then find heighest salary. He told what if 5th highest or even more. I was clean bowled but was not giving up and thinking.\n\nHe said that\u2019s it and if I had any question.\n\nI asked was round supposed to be only of DSA. He said yes, but he extended it in my case. He keep on insisting me to ask more questions. It made me remind of one of my earlier interviews where similar thing happed and last verdict was rejected. I think he had got my nerves at this point that what I was thinking. By still I asked very enthusiastically.\n\n**Round 3:** Hiring manager Round, 45 mins. Around 12 students shortlisted\nSome students had already give this round and quesions asked to them were: Multi-level caching, B,B+ Trees, Design Google forms, Twitter ER Diagram, sharding, How search happens in SQL, internships, projects\u2026 From previous interviews it was estimated that a Design question would be asked. Design part was difficult for everyone and one could pass it then, through prayers only, I guess xD.\n\nInterviewer read my resume in front of me. Asked my comfortable language to code and why I had choosen it. I said C++ and honestly said because first langage was C and C++ syntax was similar to it. Said if I have read OOPs and asked overloading. I took my proper time to thing(5-8 secs) then explaned with an example. Then asked Overriding.\nAsked about Normalization. I quickely told it and wrote\n\nNF 1,2,3,BCNF,4,5\n\nI was explaining NF1, he told okay. Then asked De-normaliztion. I said opposited of normaliztion. After normlization for query, sometimes we need to join tables and then perfom operations again and again. Thus to prevent that we do De-normalization to save that time.\nThis time I was giving quick answers and was wrapping them up so that there would be no time issues and out of range cross questions be there.\n\nHe moved on to DSA.\nQ.Reverse a linked list.\nI gave stack approach, its TC & SC and explained it. He asked to code it. I was like (ohh no, I knew a better and easy approach to code but coding this approach. No no). Then donot know how confidently within 10 secs of dry run I explained my approach very well and quickly coded it and then dry run it also. He said okay and told to reduce SC to O(1).\n\nI told him I cannot reduct TC below O(N), but SC can be reduced to O(N^0.5) or O(1) so on. He said, do it in O(1).\nI said I had studied a simlar algo earlier that can be used here then perfoming some avaerage peice of my oscar award wining acting I presented my approach. Then quickly coded it. He was satisfied and said, that;s it from his side and if I had any questions for him. I said, (wait, time is 4:58, only 28 minutes and he has said all done) yes. I took few seconds, then asked about the NAVI culture and qualities a fresher should have.\n\nMy code then(correct)\n```\nclass shapes{\npublic:\n  int area(int r)\n  {\n    return pi*r*r;\n  }\n  int area(int a,int b)\n  {\n    return a*b;\n  }\n};\nNF 1,2,3,BCN,4,5\n\nNode* reversLL(Node*head)\n{\n  if(!head || !head->next)\n    return head;\n\n  stack<Node*>stck;\n  \n\n  while(head)\n  {\n    stck.push(head);\n    head=head->next;\n    stck.top()->next=NULL;\n  }\n\n  Node*resh=NULL;\n  Node*temp=NULL;\n\n  reshh=stck.top();\n  stck.pop();\n  temp=resh;\n\n  while(!stck.empty())\n  {\n    temp->next=stck.top();\n    stck.pop();\n    temp=temp->next;\n  }\n\n  return resh;\n}\n\nNode* reversLL(Node*head)\n{\n  if(!head || !head->next)\n    return head;\n\n  Node*prev,*cur,*next;\n  prev=NULL;\n  cur=head;\n\n  while(cur!=NULL)\n  {\n    next=cur->next;\n    cur->next=prev;\n    prev=cur;\n    cur=next;\n  }\n\n  return prev;\n}\n```\nNo Round 4. Total 8 students were selected and I was one of them.\n\nOther question asked from other interviewees were:\n\nFind Kth largest element\nDetect Loop in a linked list\nbuzz-fizz question\nSQL queris\nMake a DB schema for Resume\nDesign google form supporting features for Single correct, Text box and one more type answers. Seeing the complexity later it was reduced to design only for Single correct answer type questions.\nThe interview process clearly focused on DSA, DBMS and Design problems.\n\nSome wwere asked about their projects and intern works also.\n\nNotes:\nI had prepared DS well, but still did blunders in R1. Multiples times I was on backfoot, but every time I thought no worries let\u2019s do the rest good. This could be happed because similar thing had happed with me in past and I for this time I had decided to not give up at anytime even for a second. You will be up and low in interview, but make sure to have a mentality that let\u2019s do the rest good.\nNo Design question was asked from me.(little luckier).\n\nHard work of 2 years paid off well. But remember, Never Settle.\n\n',category:"Data Engineer",topic:"Interview Experiences",level:0,uploader:"Anonymous"},B.e,t.M)
